o design thinking','PROEC',1,1,'Orientação dos discentes;\r\nVisitas técnicas;\r\nCálculos luminotécnicos;\r\nSimulações computacionais','X-5','2022-12-20 19:56:30','2022-12-20 19:56:30',NULL),(12,1737,3,'14-A','Liga Acadêmica de Terapia Cognitivo-Comportamental','Liga Acadêmica de Terapia Cognitivo-Comportamental',1,1,'Orientação dos estudantes na realização de:\r\nEventos com a temática da Terapia Cognitivo-Comportamental;\r\nEscrita de resumos, pôsteres, trabalhos completos e artigos para apresentação em congressos;\r\nRealização de grupos de estudos com a temática da Terapia Cognitivo-Comportamental','X-5','2022-12-22 16:50:13','2022-12-22 16:50:13',NULL),(13,1737,3,'14-B','Liga Acadêmica de Avaliação Psicológica da Universidade de Pernambuco','Liga Acadêmica de Avaliação Psicológica da Universidade de Pernambuco',1,1,'Orientação dos estudantes na realização de:\r\nEventos com a temática da Avaliação Psicológica;\r\nEscrita de resumos, pôsteres, trabalhos completos e artigos para apresentação em congressos;\r\nRealização de grupos de estudos com a temática da Avaliação Psicológica','X-5','2022-12-22 16:52:16','2022-12-22 16:52:16',NULL),(14,1737,3,'14-C','Grupo de Avaliação e Intervenção em Uso abusivo de Álcool e e outras Drogas - GAIA/UPE','Grupo de Avaliação e Intervenção em Uso abusivo de Álcool e e outras Drogas - GAIA/UPE',1,3,'Reuniões semanais para estudo da temática da Terapia Cognitivo-Comportamental voltada para uso de abusivo de álcool e outras substâncias;\r\nOrganização de eventos','X-5','2022-12-22 16:55:15','2022-12-22 16:55:15',NULL),(15,1644,3,'14-A','Integração do Ensino, Extensão e Pesquisa para a promoção de Valores e práticas de educação para a sustentabilidade com foco na gestão de resíduos sólidos','Edital 01/2022 - DESS@POLI 2022',1,4,'Visando amenizar os impactos ambientais e sociais da interferência do homem na natureza, o grupo de ensino, extensão e pesquisa da UPE, Desenvolvimento Seguro e Sustentável — DESS, propôs a execução de um programa de\r\nextensão que objetiva integrar os conceitos de sustentabilidade nas três dimensões universitárias.\r\n\r\nO grupo Desenvolvimento Seguro e Sustentável (DESS) da Escola Politécnica de Pernambuco – POLI/UPE, tem desenvolvido, desde 2013, ações nas três dimensões universitárias: ensino, pesquisa e extensão que objetivam amenizar os impactos ambientais e sociais da interferência do homem na natureza. Essas ações ocorrem dentro e fora da POLI para garantir uma educação que integre a sustentabilidade na solução dos problemas locais. No programa DESS@POLI, as atividades ocorreram por meio do apoio a projetos e atividades como componentes curriculares de extensão, organização do Forum de Sustentabilidade, coordenação do Concurso de vídeos, publicação de audiovisuais nas mídias sociais, entre outras ações de extensão e pesquisa que visaram a ampliação da interação da universidade com o setor produtivo e educação para sustentabilidade da sociedade em geral. Atualmente, o grupo possui mais de 100 membros entre alunos, professores e funcionários da instituição, que vem interagindo com instituições nacionais e internacionais a fim de ampliar e fortalecer suas ações acadêmicas, técnicas e científicas. A interação do grupo DESS, com a sociedade e o setor produtivo, precisou fortalecer a comunicação e divulgação dos projetos e produtos gerados no grupo para dentro e fora da universidade.\r\n\r\nO programa DESS@POLI 2021 desenvolveu atividades voltadas a toda comunidade universitária, forjando oportunidades para\r\no acesso a programas internacionais de ensino, extensão e pesquisa com foco na educação para a sustentabilidade. Ademais, permitiu que o desenvolvimento sociocultural dos estudantes, professores e funcionários, se expandisse, considerando que o contato com outras perspectivas e a troca de experiências permitiu a ampliação da visão de mundo e a compreensão de que todas as pessoas são cidadãos globais e possuem responsabilidades perante toda comunidade internacional.','X-4','2022-12-26 22:40:24','2022-12-26 22:40:24',NULL),(16,1854,3,'14-A','O fole de 8 baixos: uma história nordestina para circular em festivais audiovisuais','O fole de 8 baixos: uma história nordestina para circular em festivais audiovisuais',1,1,'Projeto continuação do projeto O FOLE DE 8 BAIXOS: UMA HISTÓRIA NORDESTINA QUE NÃO PODE SER ESQUECIDA, que agora iremos submeter o curta que foi produzido para rodar pelos festivais audiovisuais.','X-5','2022-12-26 22:45:40','2022-12-26 22:45:40',NULL),(17,1854,3,'14-B','SUPER','SUPER',2,3,NULL,'X-8','2022-12-26 22:51:28','2022-12-26 22:51:28',NULL),(18,1853,3,'14-A','Programa de Laboratórios Consorciados de Empreendedorismo e Inovação Tecnológica Educacional - LAB CEITE','Programa de Laboratórios Consorciados de Empreendedorismo e Inovação Tecnológica Educacional - LAB CEITE',2,1,NULL,'X-5','2022-12-27 07:33:42','2022-12-27 07:33:42',NULL),(20,1853,3,'14-C','JIGA.PE: AUTOMATIZAÇÃO DE PROCESSOS DE GESTÃO PÚBLICA','Edital FACEPE 30/2022 JIGA.PE - JORNADA DE INOVAÇÃO GOVERNO ACADEMIA DE PERNAMBUCO',2,1,'Edital FACEPE 30/2022 JIGA.PE - JORNADA DE INOVAÇÃO GOVERNO ACADEMIA DE PERNAMBUCO','X-5','2022-12-27 07:36:24','2022-12-27 07:36:24',NULL),(21,1852,3,'14-A','SUPER 2022: UM EVENTO DE EXTENSÃO UNIVERSITÁRIA PARA O AGRESTE PERNAMBUCANO','SUPER 2022',2,2,'Orientação da equipe de voluntários, planejamento do evento','X-8','2022-12-27 15:39:56','2022-12-28 15:27:48',NULL),(22,1852,3,'14-B','OPEMAT','OPEMAT',2,1,'Colaborar com o planejamento e aplicação das provas das Olimpíadas Pernambucanas de Matemática','X-5','2022-12-27 15:44:21','2022-12-27 15:44:21',NULL),(23,1856,3,'14-A','SUPER 2022','Super 2022',2,1,'Participei das atividades de divulgação, auxiliei na organização dos processos de inscrição e conduzi uma das apresentações do evento','X-4','2022-12-27 17:39:04','2022-12-27 17:39:04',NULL),(24,1856,3,'14-B','JCE 2022','Super 2022',1,1,'Organização da programação, condução das apresentações, coleta das avaliaçõ