,'X-5','2023-01-05 20:28:55','2023-01-05 21:03:18',NULL),(42,1517,3,'14-B','Projeto de Extensão da Basílica do Carmo, em Recife, para desenvolvimento dos Projetos Elétrico, Luminotécnico e de Aterramento.','Edital PROEC Fluxo Contínuo - 02/2022',2,1,'Desenvolvido o Projeto Elétrico do Prédio da Basílica do Carmo, em Recife, com base na\r\nNorma NBR 5410:2008 (Última atualização), gerando uma nova instalação elétrica, \r\nsegura e sem risco de acidentes/ incêndios, abrangendo, Projetos Luminotécnico e de Sistema de Aterramento.','X-5','2023-01-05 20:52:28','2023-01-05 21:07:17',NULL),(43,1624,3,'14-A','HidroWAN','PDTE 2022 - Programa de Desenvolvimento Tecnológico e Extensão Escola Politécnica da Universidade de Pernambuco',1,4,'Descrição: Introdução A telemetria aplicada aos serviços públicos, em especial fornecimento de água tratada e coleta de esgotos, tem por objetivo a obtenção de dados em tempo real para estudo do comportamento do consumidor e melhoria dos serviços ofertados, além de ser uma ferramenta para redução de perdas das concessionárias. O objetivo deste projeto de pesquisa é continuar o projeto iniciado no PDTE 2018 intitulado \"Telemetria para hidrômetros residenciais\", que foi o desenvolvimento de um sistema de telemetria sem fio (wireless) de hidrômetros residenciais e comerciais de pequeno porte. Em 2018 foi desenvolvido o hardware e software para leitura de um hidrômetro genérico, que gerou a defesa de PFC em formato de artigo do aluno bolsista à época. Nessa próxima fase do projeto será desenvolvida a rede sem fio para comunicação entre os hidrômetros e uma estação base para coleta dos dados de volume consumido dos clientes. As principais características dessa rede são o longo alcance, maior que 500 metros em ambiente urbano, baixo consumo de energia, que possibilite a alimentação via bateria, e baixa taxa de transmissão, tendo em vista uma leitura diária do consumo dos clientes. Essa leitura diária é um avança em comparação com a leitura mensal realizada pelos leituristas das concessionárias. A proposta é que a solução completa seja economicamente viável, com custo final menor ou equivalente que o custo de leitura do consumo mensal por meio de leituristas. Público em potencial: consumidores residenciais e comerciais das concessionárias de saneamento básico, que em Pernambuco é representada pela Compesa (Cia. Pernambucana de Saneamento), possuindo 1.253.000 domicílios na Região Metropolitana do Recife (fonte: Anuário Estatístico de Pernambuco ? 2016). Como parcerias institucionais para ação em conjunto, o projeto é de interesse das concessionárias de saneamento básico, que na região é representada pela Compesa. A coordenação de hidrometria da Compesa está dando suporte ao projeto, fornecendo os hidrômetros comerciais para os testes dos sistemas propostos. Este projeto de extensão possui interesses em comum com o projeto de extensão AquaPOLI e do projeto L?Acqua de cooperação Compesa/UFPE. Ao final do projeto será entregue um protótipo funcional da rede sem fio em operação e um artigo para submissão à REPA/Poli. Objetivos Geral: Desenvolver uma rede sem fio para telemetria de hidrômetros residenciais e comerciais de pequeno porte que seja economicamente viável. O custo final da solução completa deve ser menor ou equivalente que o custo de leitura do consumo mensal por meio de leituristas. Específicos desta segunda etapa do projeto: Aprimorar o firmware com relógio de tempo real (RTC - Real Time Clock); Integrar o circuito de comunicação e de gerenciamento de energia no dispositivo de leitura individual de hidrômetros; Definir o sistema de comunicação a ser utilizado entre a rede de hidrômetros sem fio e o sistema supervisório. Justificativa Redução no tempo de leitura do consumo individual de água de mensal para diário. Melhoria na análise do perfil de consumo de água em uma dada região geográfica. Aumento das informações disponíveis para desenvolver estratégias de abastecimento diferentes e busca pela redução das perdas. Metodologia O aluno bolsista deverá aplicar os conceitos de eletrônica básica, sistemas digitais e princípios de telecomunicações para desenvolver uma rede sem fio e de baixo consumo de energia para medir o consumo de água de um hidrômetro comercial preparado para telemedição. Equipar esse leitor com uma rede de comunicação sem fio de baixo consumo de energia, baixa taxa de transmissão e alcance de cerca de 100 metros utilizando uma placa de desenvolvimento ESP32 equipada com um módulo LORA. Teste das principais redes sem fio que abrangem essa faixa de operação. Cálculo do consumo de energia estimado de cada unidade leitora.','X-5','2023-01-10 17:05:18','2023-01-10 17:05:31',NULL),(44,1076,3,'14-A','RECURSOS EDUCACIONAIS ABERTO: APRENDENDO COLABORATIVAMENTE E COMPARTILHANDO CONHECIMENTOS NA COMUNIDADE UNIVERSITARIA','EDITAL PFA EXTENSÃO',2,2,NULL,'X-5','2023-01-16 17:24:20','2023-01-16 17:24:20',NULL),(45,1639,3,'14-A','Construção POLI','Construção POLI',1,1,'Articulação da extensão com o ensino e a pesquisa, proporcionando aos participantes a aplicação prática do conhecimento teórico e dos princípios da racionalização construtiva e desenvolvimento tecnológico à formação profissional de discentes do curso de engenharia civil e à atuação dos agentes da Construção Civil, orientado a melhoria da qualidade, produtividade, tecnologia, desempenho e sustentabilidade.\r\nAtividades desenvolvidas:\r\n•	aplicar os conhecimentos oriundos do aprendizado e desenvolvimento das pesquisas da pós-graduação stricto sensu no ensino da graduação (envolvimento de discentes de pós-graduação);\r\n•	investigar e caracterizar a realidade local das técnicas de execução de serviços de construção das edificações com análise comparativa do aprendizado e divulgação junto as equipes gestoras de obras de empresas construtoras (envolvimento de discentes de graduação e da comunidade selecionada);\r\n•	desenvolver relatório em formato de artigo e seminário de apresentação que descreva a aplicação da racionalização à técnica de execução aplicado ao problema local identificado em obra (envolvimento de discentes de graduação e da comunidade selecionada);\r\n•	propor melhorias que coloque em prática os conceitos aprendidos favorecendo à comunidade local específica (envolvimento de discentes de graduação e da comunidade selecionada).','X-5','2023-01-16 18:21:37','2023-01-16 18:21:37',NULL),(46,1609,3,'14-A','Carranca','Programa Carranca',1,4,'O Programa Carranca engloba dois projetos: \r\n- Equipe de Robótica carranca: Focado em desenvolver robôs para participar de desafios de robótica, apresentações e visitas à escolas.\r\n- NEAR (Núcleo de Engenharia em Automação e Robótica): Focado mais em pesquisa e desenvolvimento de soluções na área de Automação, sistemas embarcados e robótica. Este projeto dá suporte ao da Equipe de Robótica.','X-4','2023-01-27 20:59:11','2023-01-27 20:59:11',NULL),(47,1622,3,'14-A','Desenvolvimento Tecnologico das Telecomunicações (DETT)','Desenvolvimento Tecnologico das Telecomunicações (DETT)',1,2,'Realização de seminários de tecnologia e inovação','X-5','2023-01-29 00:12:37','2023-01-29 00:12:37',NULL),(48,1628,3,'14-A','PROJETO AUTOMASTER','Edital PROEC de Fluxo Contínuo Extensão 2022',1,2,NULL,'X-5','2023-01-31 17:26:17','2023-01-31 17:49:31',NULL),(49,1628,3,'14-B','PROGRAMA DE EXTENSÃO PARA CAPACITAÇÃO EM DESENVOLVIMENTO BACKEND COM .NET','Edital PROEC de Fluxo Contínuo Extensão 2022',1,2,NULL,'X-5','2023-01-31 17:26:38','2023-01-31 17:49:35',NULL),(50,1628,3,'14-C','DCEXT - FERRAMENTAS COMPUTACIONAIS PARA ENGENHARIA','Edital PROEC de Fluxo Contínuo Extensão 2022',1,2,NULL,'X-5','2023-01-31 17:26:51','2023-01-31 17:49:38',NULL),(51,1628,3,'14-D','Grupo de Estudos em Segurança da Informação','Edital PFA 01/2022',1,2,NULL,'X-5','2023-01-31 17:28:44','2023-01-31 17:49:42',NULL),(52,1713,3,'14-A','PROMOVENDO A SAÚDE: uma abordagem integrada sobre diabetes mellitus e hipertensão arterial','PRÓ-REITORIA DE EXTENSÃO – PROEC EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,6,'o presente projeto de extensão pretende disseminar informações sobre hipertensão e diabetes,\r\nduas doenças crônicas muito presentes na vida dos brasileiros. Essa atividade será realizada por meio ações presenciais, tendo como alvo as USFs do município, através de atitudes de conscientização, como também movimentos para a aferição de pressão e glicemia capilar, de maneira a gerar diálogo com o público geral e consequentemente a propagação do conhecimento imprescindível proposto pelo projeto. Com isso, pretende-se esclarecer dúvidas sobre o que são essas doenças, o que fazer para preveni-las e, caso acometido, orientar hábitos saudáveis para prevenção de possíveis complicações decorrentes destas patologias.','X-5','2023-02-01 00:34:51','2023-02-01 00:34:51',NULL),(53,1713,3,'14-B','Educação em saúde na adolescência: prevenção e orientações sobre IST e gravidez precoce','PRÓ-REITORIA DE EXTENSÃO – PROEC EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,6,'A gravidez na adolescência é um problema de saúde pública e um desafio para os profissionais de saúde, visto que tal fenômeno impacta negativamente na integralidade da saúde materno-fetal. Sabe-se que, independentemente da maternidade, a adolescência é uma fase frágil devido às mudanças biopsicossociais sofridas e, assim, a gravidez na adolescência potencializa um processo já conflituoso e complexo. O Brasil tem cerca de 19 mil nascimentos, ao ano, de mães entre 10 a 14 anos (BRASIL, 2020). De modo associado, entende-se que as infecções sexualmente transmissíveis (ISTs) representam também um grande desafio no âmbito da saúde pública, impactando, de forma negativa, a qualidade de vida da população afetada. Dessa forma, na abordagem de medidas preventivas voltadas para o adolescente, é importante considerar as Unidades de Saúde da Família como lugares propícios e adequados para se desenvolver atividades educativas e trabalhar conhecimentos, habilidades e mudanças de comportamento, tendo em vista ser o vínculo principal entre a comunidade e os profissionais de saúde, outros locais podem ser atingidos quando articulados à Unidade de Saúde, como residências e escolas. Considerando o exposto, é imprescindível as ações de prevenção à gravidez na adolescência e à infecção por ISTs, o cuidado e apoio a esse público-alvo que por vezes, encontram-se em situação de vulnerabilidade. Através de atividades educativas com adolescentes e ações de orientações com gestantes adolescentes, acadêmicos de medicina podem contribuir para uma redução dos números de casos e dos índices de mortalidade relacionados à gestação precoce, bem como cooperar para a diminuição dos índices de infecção por ISTs.','X-5','2023-02-01 00:54:41','2023-02-01 00:54:41',NULL),(54,1633,3,'14-A','DCEXT - Fundamento de Telecomunicações','DCEXT - Fundamento de Telecomunicações',2,2,NULL,'X-6','2023-02-02 03:45:58','2023-02-02 03:45:58',NULL),(55,2010,3,'14-A','Elas e a matemática: promovendo inclusão no Vale do São Francisco','Programa/Projeto',1,3,'Durante séculos, as mulheres foram alvo de exclusão e silenciamento em diversos segmentos da sociedade. Atualmente, apesar dos grandes avanços e conquistas, muitos problemas ainda estão presentes e se mostram extremamente resistentes. A pouca inserção e permanência da figura feminina em diversas áreas, tais como na Matemática é, certamente, um deles. Percebendo isso, o presente projeto de extensão buscará incentivar e despertar o interesse de meninas por Matemática, deste modo estimulando também o interesse (e a permanência) de mulheres em profissões e pesquisas na área de ciências exatas.','X-4','2023-02-02 14:53:43','2023-02-02 14:53:43',NULL),(57,1650,3,'14-A','Áreas verdes com espécies nativas para melhoria da qualidade de vida nas cidades: uma aproximação com insetos e serviços ecossistêmicos associados Situação: Desativado; Natureza: Extensão.','PFA',2,4,'Coleta e amostragem de plantas em campo;\r\nIdentificação de espécies vegetais;\r\nOrie