íficos\r\nFavorecer a interação entre os licenciandos de Ciências Biológicas e as comunidades escolares de Garanhuns e das cidades circunvizinhas;\r\nLevar a partir da ação dos licenciandos propostas de letramento científico utilizando a ludicidade como ferramenta potencializadora do processo ensino aprendizagem;\r\nAtuar como facilitador do processo de reconhecimento da ciência como participante do cotidiano da sociedade;\r\nPromover as atividades de ensino de Química para além dos muros da UPE.','X-5','2023-02-06 22:59:16','2023-02-06 22:59:16',NULL),(91,1626,3,'14-A','POLI ACESSÍVEL','POLI ACESSÍVEL - CSEC POLI',1,2,'Acompanhamento das ações desenvolvidas pelos estudantes para auxiliar nas atividades de promover acessibilidade na Escola Politécnica de Pernambuco.\r\nInvestigar a infraestrutura da Instituição e propor melhorias de fácil execução para adequar às normas vigentes a respeito de acessibilidade para portadores de necessidade especiais.','X-6','2023-02-06 23:05:59','2023-02-06 23:05:59',NULL),(92,1828,3,'14-A','Elaboração de Cartilhas para a Promoção/Divulgação de Direitos dos Usuários e Familiares da Saúde Mental','Elaboração de Cartilhas para a Promoção/Divulgação de Direitos dos Usuários e Familiares da Saúde Mental',2,4,'A presente proposta pretende confeccionar cartilhas para a promoção/divulgação/educação em direitos humanos para usuários de serviços de Saúde Mental no estado de Pernambuco, bem como esclarecer seus familiares acerca dos direitos desses usuários. Desde 1991, a ONU propõe que os usuários desses serviços sejam esclarecidos sobre os seus direitos para que não se possa ter retrocessos nos avanços da luta antimanicomial e da promoção e proteção da dignidade da pessoa humana, na condição de sujeito de direitos. Hodiernamente, os leitos de internação em manicômios vêm sendo gradualmente substituídos por políticas de tratamento e integração social, auxiliando o usuário da Saúde Mental a não deixar a família e a comunidade em que vive, desmistificando o conceito de periculosidade desse usuário. As práticas integrativas são determinantes para o sucesso do tratamento e o saber de como e de onde busca-las é uma política de direitos humanos essencial para o sucesso desses programas. Introdução e Justificativa (até 500 palavras): Quando Pinel fez a visita ao Manicômio de Paris em meados do século XIX ele descobriu um ?tratamento? baseado na pedagogia da desumanidade. Pessoas nuas, amarradas ou acorrentadas, feridas em seus corpo e alma, era assim a realidade dos manicômios pelo mundo (OLIVEIRA, 2017). No Brasil, entramos para o roteiro do horror internacional com Hospital Colônia da Barbacena, descrito como ?campo de extermínio? pelo célebre psiquiatra italiano Franco Basaglia (ARBEX, 2013), um dos maiores nomes da luta antimanicomial na Itália e que muito influenciou a mesma luta no Brasil. Mas Barbacena não era um cenário muito diferente do que ocorria no restante do país, Sobre um discurso de que o louco era perigoso, rotulando como louco tudo aquilo que fosse anormal ou desviante em relação a condutas padrões, o manicômio virava cárcere, sem acesso a visitas, nem advogados, nem cuidados... A doença mental se torna, nesse cenário, um sinônimo de interdição e maldição (FOUCAULT, 2019). A triste situação dos manicômios só começa a mudar a partir do surgimento de outros tratamentos, como a discussão de Freud sobre as neuroses e a não recomendação de internamento para tratar desses casos (OLIVEIRA, 2017). Apesar da existência da possibilidade da não internação, no Brasil esse discurso só ganha força a partir da greve dos trabalhadores da saúde mental de 1982, quando se forma um discurso contra os poderes instituídos e a favor de um tratamento humanizado para usuários da saúde mental (SANTOS; PONTES, 2017). Mas a grande transformação ocorre com o advento da Constituição de 1988, com a criação do SUS e com a ideia de que o tratamento antidrogas não era mero caso de polícia, mas de saúde pública. A partir de 1991 tanto em relação a legislação internacional, com a ONU criando os ?Princípios para a proteção de pessoas acometidas de transtorno mental e para a melhoria à saúde mental? , bem como os estados da federação brasileira criando legislações próprias, a luta antimanicomial começa a desativar leitos nos manicômios e hospitais equivalente e se dá início a um política pública humanizada de tratamento de usuários da saúde mental (SANTOS; PONTES, 2017). Pernambuco ingressa nessa luta desde 1994, sendo o segundo estado a adotar medidas para fechar leitos em manicômios e garantir tratamento inclusivo e a favor da diversidade para esses usuários. Quando a Lei Paulo Delgado, Lei 10.2016/01, entrou em vigor após 12 anos de tramitação, Pernambuco já tinha significados avanços nos tratamentos em CAPS e entidades equivalentes. Mas extinguir leitos manicomiais e fornecer tratamentos não é suficiente para atender os usuários da saúde mental, é preciso que ele e sua família saibam que esses tratamentos existem e como se deve ter acesso eles. A linguagem jurídica ou médica, presente em leis e atos administrativos da Saúde Mental, não são claras e não.','X-5','2023-02-06 23:24:28','2023-02-06 23:31:28',NULL),(93,1828,3,'14-B','Papo de Quinta - Ciclo de Debates Insurgentes','Papo de Quinta - Ciclo de Debates Insurgentes',2,2,'O ciclo de debates ?Papo de quinta? tem como objetivo agregar pesquisadores(as) quanto as inovações dos campos de estudos em Biopolítica, Gênero, Educação e Teoria Crítica da Raça interseccionados ao campo da Ciências Humanas e Sociais Aplicadas. Dessa forma, a dinâmica do projeto envolverá o convite a pessoas de diversos segmentos sociais e institucionais para discutir determinados campos e questões fora e dentro da universidade.','X-4','2023-02-06 23:25:34','2023-02-06 23:31:17',NULL),(94,1828,3,'14-C','PROGRAMA DE APOIO E ACOMPANHAMENTO PARA ACESSO À PÓS-GRADUAÇÃO STRICTU SENSU','PROGRAMA DE APOIO E ACOMPANHAMENTO PARA ACESSO À PÓS-GRADUAÇÃO STRICTU SENSU',2,4,'O Programa, é uma iniciativa para atender diretamente estudantes egresso(as) da Universidade de Pernambuco e de outras Instituições de Ensino Superior que estejam ou que façam parte de grupos vulneráveis social e/ou economicamente e que anseiam por ingressar em Programas de Pós Graduação Stricto Sensu das áreas de Ciências Humanas e Sociais Aplicadas. As frentes de trabalho do Programa são três: a formação, por meio de oferecimento de seminários temáticos aos(às) discentes; o acompanhamento individual dos projetos e planos de trabalho para ingresso nos programas escolhidos; e, a produção e divulgação aberta de materiais didáticos por plataformas de vídeos e podcasts de acesso gratuito. O principal objetivo é colaborar para o acesso, oportunidade e diversidade de pessoas em vulnerabilidade socioeconômica nos Programas de Pós-graduação Stricto Sensu das áreas de Ciências Humanas e Sociais Aplicadas..','X-4','2023-02-06 23:26:23','2023-02-06 23:31:36',NULL),(95,1626,3,'14-B','PROJETO TENPEST AERODESIGN','PROGRAMA TENPEST AERODESIGN',2,4,'Projeto de construção de aeronaves para participar em competição SAE BRASIL.\r\nO programa tem um número mínimo de 15 estudantes que atuam desde o projeto até a construção da aeronave, percorrendo todas as etapas de desenvolvimento de projeto.','X-4','2023-02-06 23:52:41','2023-02-06 23:54:06',NULL),(96,1954,3,'14-A','Projetos de capacitação continuada dos campos de atuação profissional do curso de Serviço Social da UPE.','EDITAL/PROCESSO:	EDITAL PFA EXTENSÃO',1,4,NULL,'X-5','2023-02-07 00:09:38','2023-02-07 00:09:38',NULL),(97,1626,3,'14-C','Projeto Carroça Elétrica','Projeto de Carroça Elétrica',1,2,'Projeto de veículo elétrico para cooperativas de catadores de resíduos recicláveis\r\nEspecificar todos os sistemas de um veículo de carga para auxiliar os catadores','X-5','2023-02-07 00:59:35','2023-02-07 00:59:35',NULL),(98,1735,3,'14-A','Modelos anatômicos no ensino fundamental e médio: um instrumento facilitador para o estudo da ana