ão e transmissão de conhecimentos construídos socialmente e relacionados às formas de trabalho.','X-8','2023-02-09 17:17:48','2023-02-09 17:37:54',NULL),(134,1932,3,'14-B','Pesquisa e Elaboração de Projetos Científicos em Educação','Curso de Extensão coordenado pelo Programa de Pós-Graduação em Educação (PPGE)',2,1,'O curso de extensão Pesquisa e Elaboração de Projetos Científicos em Educação busca instrumentalizar professores(as), profissionais da educação básica e alunos(as) concluintes de graduação para a elaboração do projeto de pesquisa em educação. No decorrer do curso, buscaremos refletir a respeito do processo de realização da pesquisa cientifica na área da educação; debater a respeito de aspectos inerentes à pesquisa em educação; discutir tipos de pesquisa com intervenção nos seus aspectos conceituais teóricos e metodológicos; apresentar bases teóricas e ferramentais para construção de textos científicos; refletir sobre estratégias de elaboração de projetos de pesquisa. A pesquisa cientifica é a base do curso, que discutirá tipologias de pesquisa com ênfase nas pesquisas com intervenção, como por exemplo, a pesquisa-ação (BARBIER, 2016); (THIOLLENT, 2017). O curso de extensão terá caráter expositiva e explicativa.','X-6','2023-02-09 17:20:22','2023-02-09 17:20:22',NULL),(135,1932,3,'14-C','Técnicas de Leitura Instrumental para Exame de Proficiência Acadêmica (Turma III)','Proficiência em Língua Estrangeira (PLE)',1,1,'O curso de Proficiência em Língua Estrangeira (PLE) é um projeto de extensão que acontece anualmente. O curso acontece com abertura de duas turmas do corrente ano. É subsidiado pelo do atual Programa de Pós-Graduação em Educação-PPGE, da Universidade de Pernambuco, Campus Mata Norte. O curso é mantido por professor(es) do PPGE proficientes em uma das línguas estrangeiras ofertadas (inglês ou espanhol) no curso. O objetivo geral do curso é preparar o(a) pós-graduando(a) para a realização do Exame de Proficiência em uma Língua Estrangeira por meio das técnicas de leitura instrumental que possibilite agilidade na leitura dos textos elencados neste tipo de teste. As línguas estrangeiras para as quais o PLE oferece o curso de técnicas de leitura instrumental será para Língua Inglesa e/ou Língua Espanhola. Contudo, independente da língua estrangeira em estudo, com o auxílio dessas técnicas de leitura, o(a) pós-graduando(a) conseguirá realizar o entendimento de todo o texto.','X-6','2023-02-09 17:22:36','2023-02-09 17:22:36',NULL),(136,1827,3,'14-A','AUTOMATIZAÇÃO DE PROCESSOS DE GESTÃO PÚBLICA','Jornada de Inovação Governo Academia - PE',2,3,'Formação de servidores públicos do Estado de Pernambuco para o desenvolvimento de Produtos Mínimos Viáveis','X-5','2023-02-10 00:29:35','2023-02-10 04:09:32',NULL),(137,1827,3,'14-B','Revista Pernambucana de Administração','Revista Pernambucana de Administração',2,2,'Professora colaboradora','X-5','2023-02-10 00:31:38','2023-02-10 04:09:41',NULL),(138,1921,3,'14-A','Saúde ambiental e educação: elaboração de estratégias didáticas a partir da análise das condições ambientais e seu impacto nos níveis de saúde do município de Nazaré da Mata- PE','PFA',1,4,'Elaboração de projeto, direcionamento de atividades, coordenação de estudantes, comunicação com a comunidade externa à universidade, aplicação das propostas planejadas e elaboradas ao longo da execução do projeto.','X-5','2023-02-10 01:50:22','2023-02-10 01:50:22',NULL),(139,1712,3,'14-A','Liga Acadêmica em Terapia Cognitivo Comportamental','Liga Acadêmica em Terapia Cognitivo Comportamental',1,6,'Liga Acadêmica em Terapia Cognitivo Comportamental, onde ocorre grupo de estudos, treino de habilidades e organização de eventos.','X-5','2023-02-10 02:07:57','2023-02-10 02:07:57',NULL),(140,1941,3,'14-A','TV Nephel - Educação','TV Nephel - Educação',2,2,NULL,'X-5','2023-02-10 02:42:57','2023-02-28 01:35:14',NULL),(141,1941,3,'14-B','III Ciclo de Debates da linha de pesquisa Alfabetização, Letramento e Estágio na Formação Inicial