amiliar. O Preconiza a elaboração de estratégias de recuperação de solos degradados, enriquecimento da biodiversidade e ampliação da produtividade dos sistemas ambientais. As atividades envolverão a capacitação de estudantes do curso de Geografia do campus Garanhuns para a instalação, acompanhamento e difusão de estratégias de conservação e recuperação ambiental.','X-5','2023-02-10 22:52:28','2023-02-10 22:52:28',NULL),(157,1703,3,'14-A','Formação de Professores da Educação Básica em Fernando e Noronha','Fluxo Contínuo 2022',1,2,NULL,'X-4','2023-02-11 00:42:20','2023-02-11 00:42:20',NULL),(158,1698,3,'14-A','Projeto: Revista Pernambucana de Administração','Projeto: Revista Pernambucana de Administração',2,4,NULL,'X-5','2023-02-11 00:50:42','2023-02-11 00:50:42',NULL),(159,1691,3,'14-A','Desenvolvimento de uma solução tecnológica para artistas musicais do agreste pernambucano','Projeto',1,4,'Coordenar as atividades do projeto por meio de reuniões semanais com os estudantes extensionistas','X-5','2023-02-11 05:12:55','2023-02-11 05:12:55',NULL),(160,1691,3,'14-B','CURSO DE FORMAÇÃO EM BLOCKCHAIN E METAVERSO','Curso',1,3,'Coordenação da realização do curso','X-6','2023-02-11 05:20:58','2023-02-11 05:20:58',NULL),(161,1691,3,'14-C','REUPE CONECTA: VEICULAÇÃO DAS MÍDIAS DIGITAIS E FUNCIONALIDADES DO SISTEMA COMO INTEGRAÇÃO TECNOLÓGICA DA REVISTA DE EXTENSÃO DA UNIVERSIDADE DE PERNAMBUCO','Projeto',2,2,NULL,'X-5','2023-02-11 05:23:20','2023-02-11 05:23:20',NULL),(162,1651,3,'14-A','De braços dados com a História de Pernambuco','PROEC Multicampi',1,1,'O projeto colhe e organiza fontes históricas para serem usadas em pesquisa da docente e orientados, via LEPEHIS.','X-5','2023-02-11 18:17:48','2023-02-11 18:17:48',NULL),(163,1651,3,'14-B','Site Canal do GT Indígenas na História/ANPUH Brasil','PROEC Multicampi',1,1,'O site e canal tornam públicas pesquisas científicas sobre os povos indígenas no Brasil através do Grupo de Trabalho vinculado à Associação Nacional dos Historiad