e a contribuição das pesquisas no avanço do conhecimento, bem como no impacto social na comunidade local e regional. As transmissões serão realizadas pelo canal da TV Nephel UPE, na Plataforma do YouTube. https://www.youtube.com/c/TVNephelUPEPetrolina/about..\r\nSituação: Em andamento; Natureza: Extensão.\r\nAlunos envolvidos: Graduação: (11) / Mestrado profissional: (2) .','X-5','2023-02-13 16:05:00','2023-02-13 16:05:00',NULL),(172,2036,3,'14-B','TV Nephel - Ciência, Educação e Cidadania','Edital de Fluxo Contínuo Extensão',2,4,'A TV Nephel integra um conjunto de ações desenvolvidas no âmbito do Núcleo de Extensão e Pesquisa em História, Educação, Linguística e Literatura (criado por Ordem de Serviço n. 08/2014), com sede e foro na Universidade de Pernambuco, Campus Petrolina. É um canal público, educativo, de natureza universitária, interinstitucional, multi e interdisciplinar, sem fins lucrativos, que tem como finalidade a prestação de serviços de difusão pública nas áreas do ensino, da pesquisa e da extensão. Reúne 11 professores e professoras da UPE (Petrolina e Garanhuns) e 13 externos (UFRPE, UFPI, IFSERTÃO, UNIR, UNIPAMPA, UESPI, UDESC, UNESP, UNIFAP). Dispõe de Conselho Editorial, Conselho Consultivo, Coordenação de Jornalismo e Regimento próprio, que regulamenta a sua estrutura e funcionamento na Plataforma do Youtube. A produção e programação cumpre com finalidades educativas, artísticas, culturais, científicas e informativas, desenvolvidas em formatos diversos como entrevistas, documentários, seminários, colóquios, oficinas, cursos e outros. Programa de Extensão aprovado junto ao Programa de Fortalecimento Acadêmico Edital PFA Extensão - 01/2020, subordinado à Pró-Reitoria de Educação e Cultura (PROEC) da Universidade de Pernambuco..\r\nSituação: Em andamento; Natureza: Extensão.\r\nAlunos envolvidos: Graduação: (27) / Mestrado acadêmico: (6) / Mestrado profissional: (12) / Doutorado: (1) .','X-5','2023-02-13 16:08:22','2023-02-13 16:08:22',NULL),(173,2036,3,'14-C','Oficina de higienização, digitalização e catalogação de documentos escolares como prática de preservação da memória educacional no Sertão pernambucano.','Edital de Fluxo Contínuo Extensão',2,2,'A Oficina de Higienização. Digitalização e Catalogação de Documentos Escolares como Prática de Preservação da Memória Educacional do Sertão Pernambucano, aprovada em Edital de Extensão 02/2020 - Fluxo Contínuo da Pró-Reitoria de Extensão e Cultura, tem como objetivo oferecer noções práticas de higienização, digitalização e catalogação de documentos escolares, com vista à preservação da história e da memória de instituições de ensino da região. O processo de higienização consiste basicamente em três etapas. Na primeira, a preparação para uso de equipamentos de proteção individual (óculos específicos e materiais descartáveis como aventais, máscaras, toucas e luvas). A segunda etapa destina-se aos procedimentos de higienização, incluindo manuseio e técnicas de remoção de sujidade e a terceira encarrega-se da digitalização e catalogação dos documentos. A oficina compõe uma das interfaces do Projeto de Pesquisa Os Arquivos Escolares como Fonte de Pesquisa para a História da Educação contemplado no Programa Primeiros Projetos PPP/FACEPE/CNPq em vigência até 2020. Carga horária semanal: 08 horas. Público alvo: alunos do curso de Pedagogia e demais licenciaturas do Campus, professores e servidores da rede básica de ensino..\r\nSituação: Em andamento; Natureza: Extensão.\r\nAlunos envolvidos: Graduação: (5) / Mestrado profissional: (4) .','X-7','2023-02-13 16:10:01','2023-02-13 16:10:01',NULL),(174,1487,3,'14-A','UPE mais verde','UPE mais verde',1,8,NULL,'X-4','2023-02-13 16:34:44','2023-02-13 16:38:17',NULL),(175,1942,3,'14-A','Chamada para Tradutores de Espanhol (Edital PROEC 10/2021)','Chamada para Tradutores de Espanhol (Edital PROEC 10/2021)',2,6,'Realizar tradução de legendas para material audiovisual a ser veiculado na TV Pernambuco','X-5','2023-02-13 16:46:42','2