 00:52:19',NULL),(189,2049,3,'14-B','Programa de Extensão em Fisioterapia Neonatal e Pediátrica – BABY GRUPE','Programa de Extensão em Fisioterapia Neonatal e Pediátrica – BABY GRUPE',1,2,'O programa Baby GrUPE compõe um conjunto de ações, de caráter institucional, que serão realizados com o objetivo de disseminar conhecimentos sobre a fisioterapia neonatal e pediátrica, de forma a promover a aquisição e desenvolvimento de competências e habilidades para o docente de graduação em Fisioterapia. Dentro desse programa, as ações serão realizadas articulando os componentes curriculares do ciclo pré-profissional e profissional, no intuito de utilizar o cenário do ambulatório de seguimento infantil para que os discentes coloquem à disposição da comunidade os conhecimentos adquiridos. Seminários avançados, articulação com projeto de pesquisa; elaboração de cartilhas educativas e promoção de rodas de conversa com os atores da comunidade são alguns dos projetos a serem executados.','X-4','2023-02-15 15:05:02','2023-02-24 00:52:42',NULL),(190,2049,3,'14-C','V de Vacina: V de Vida','Programa de Extensão em Fisioterapia Neonatal e Pediátrica – BABY GRUPE',1,1,'Vacinar-se é a melhor maneira de se proteger, não somente de forma individual, mas também coletiva, evitando, dessa forma, a propagação de doenças, bem como reduzindo os riscos de morbimortalidade, uma vez que as vacinas promovem a sensibilização do sistema imunológico do organismo, garantindo a formação de anticorpos para a defesa e proteção contra uma variedade de doenças. Dessa forma, o projeto “V de Vacina, V de Vida”, almeja transmitir informações, assim como orientar aos pais e familiares, acerca da importância da vacinação infantil, visto que, nos últimos anos, vem havendo um decréscimo no número de crianças vacinadas, no Brasil, ocasionando, maiores riscos para a contaminação e propagação de novas doenças e, até mesmo, de doenças que já haviam sido erradicadas, culminando em ameaças para a saúde e qualidade de vida das crianças. Portanto, a vacinação infantil é um ato de cuidado, prevenindo-as e proporcionando bem estar físico e psicossocial.','X-4','2023-02-15 15:06:06','2023-02-15 15:06:06',NULL),(191,1979,3,'14-A','Programa de Educação para Melhor Idade no Vale do São Francisco – FATI  (com fomento)','Programa de Educação para Melhor Idade no Vale do São Francisco – FATI  (com fomento)',2,8,NULL,'X-4','2023-02-15 22:21:36','2023-02-24 21:02:11',NULL),(192,1979,3,'14-B','Programa de Promoção à Saúde e Prevenção das Emergências, Acidentes e Violências no Vale do São Francisco - PROPEAV','Programa de Promoção à Saúde e Prevenção das Emergências, Acidentes e Violências no Vale do São Francisco - PROPEAV',2,8,NULL,'X-4','2023-02-15 22:22:22','2023-02-24 21:02:24',NULL),(193,1708,3,'14-A','Liga de Anestesiologia e Terapia Intensiva','Liga Acadêmica',1,2,NULL,'X-4','2023-02-15 22:30:45','2023-02-15 22:30:45',NULL),(194,1167,3,'14-A','Bureau de Gestão','Conecta Fcap',1,2,'O Bureau de Gestão tem como objetivo principal dar suporte acadêmico a alunos que estejam engajados em projetos de extensão. \r\nProfessores disponibilizam orientação, nas suas respectivas áreas do conhecimento, aos discentes envolvidos em projetos de extensão que realizem algum tipo de serviço à comunidade.\r\nA intenção é garantir a qualidade dos trabalhos desenvolvidos.','X-5','2023-02-16 16:26:08','2023-02-24 03:34:30',NULL),(195,1167,3,'14-B','Modateca','Modateca',2,2,'Aula para os alunos Modateca.','X-4','2023-02-16 16:27:09','2023-02-16 16:38:18',NULL),(196,1167,3,'14-C','Colabora Fcap','Conecta Fcap',1,6,'Orientação e suporte a alunos que desenvolverão ações de apoio a instituições sociais.','X-5','2023-02-16 16:31:12','2023-02-24 04:00:23',NULL),(197,1167,3,'14-D','Negócios e Inovações Digitais','Conecta Fcap',1,2,'Realização de palestras e cursos sobre inovações e novos negócios no mundo digital. Em breve, o projeto contará com visitas técnicas a startups e empresas que inovam em seus processos.','X-5',