escucha y oralidad, também estaremos contribuindo para uma formação crítica e linguística dos estudantes de Letras de Língua Espanhola.','X-6','2023-02-18 03:48:02','2023-02-24 03:40:40',NULL),(205,1995,3,'14-A','ENSINO DE LÍNGUA INGLESA','FATI- FACULDADE ABERTA Á TERCEIRA IDADE',2,8,'Projeto faz parte do programa FATI com  Língua estrangeira para idosos ministrada por alunos extensionistas  orientados por esta docente..','X-4','2023-02-18 03:54:02','2023-02-24 17:12:11',NULL),(207,1919,3,'14-A','Cultura e Memória: os mestres contam suas Histórias','PFA PROEC',1,1,'O projeto Cultura e Memória: os mestres contam suas histórias é uma iniciativa do LEHR ? Laboratório de Estudos de História das Religiões e visa divulgar os saberes das culturas populares por meio da produção audiovisual. A proposta consiste numa intervenção cultural, extensionista e pedagógica, com a produção de dois curtas metragens, pautados nas experiências de vida de mestres da cultura popular de Pernambuco. A iniciativa contemplará as redes de relacionamento, a mobilização social, entre outras práticas que garantam a salvaguarda dos bens. O material produzido ampliará o acervo de História Oral e memória coordenado pelo LEHR, possibilitando novas pesquisas nas áreas de Ensino de História, Antropologia, Educação Patrimonial e outras áreas. Os vídeos também poderão subsidiar componentes curriculares da graduação, trabalhos com a educação básica, pesquisas nos programas de pós-graduação e investigações externas a UPE.','X-5','2023-02-19 18:54:16','2023-02-19 18:54:16',NULL),(208,2070,3,'14-A','DIREITO À IGUALDADE E DIREITO À DIFERENÇA','UPErto de você – (re)encontros das diferenças culturais pós-isolamento social',2,1,'Programa de Extensão vinculado às Vivências Extensionistas, aprovado em PFA-1 2022.','X-4','2023-02-19 21:45:18','2023-02-19 21:45:18',NULL),(209,2070,3,'14-B','Cá entre nós','UPErto de você – (re)encontros das diferenças culturais pós-isolamento social',1,1,'Realização de rodas de conversas sobre temas emergentes no campo da educação, por meio da plataforma do YouTube.','X-5','2023-02-19 21:48:06','2023-02-19 21:48:06',NULL),(210,1967,3,'14-A','Espanhol','Faculdade Aberta da Terceira Idade',2,4,NULL,'X-5','2023-02-20 02:16:52','2023-02-20 02:16:52',NULL),(212,1967,3,'14-C','Lugar de criação','Programa Lugar de Criação',1,8,NULL,'X-4','2023-02-20 02:24:29','2023-02-20 02:24:29',NULL),(213,1967,3,'14-D','Lugar de Fruição','Programa Lugar de Criação',1,4,NULL,'X-5','2023-02-20 02:26:24','2023-02-20 02:26:24',NULL),(214,2038,3,'14-A','Lugar de Criação','Programa Lugar de Criação',1,8,NULL,'X-4','2023-02-20 17:02:38','2023-02-20 17:02:38',NULL),(215,2038,3,'14-B','Lugar de Fruição','Lugar de Fruição',1,4,NULL,'X-4','2023-02-20 17:03:41','2023-02-20 17:03:41',NULL),(216,2079,3,'14-A','POLITICA NO BRASIL E A QUESTÃO AGRÁRIA: uma relação continua entre universidade e comunidade','Não é Programa e sim Projeto',1,6,'Os estudos ocorrem uma vez por semana obedecendo a seguinte dinâmica:\r\n•	As temáticas para discussões partem das questões políticas que repercutem diretamente na vida das pessoas e, especialmente, na questão agrária, tendo como base o materialismo histórico dialético;\r\n•	Presença dos alunos/alunas da UPE e outras Instituições, bem como, egressos ou outras pessoas da comunidade, inscritos e sua continua participação;\r\n•	Leituras de textos ou livros, associados a debates com temáticas especificas;\r\n•	O professor é o orientador;\r\n•	Os alunos serão responsáveis pelo grupo com o auxílio do professor orientador;\r\n•	Os textos devem ser lidos por todos os membros do grupo, sendo responsáveis os/as alunos/as mestrandos e da iniciação cientifica orientados pela coordenadora do grupo; \r\n•	Além de textos serão trabalhados filmes/documentários para debates;\r\n•	Após o debate, uma breve avaliação sobre aquilo que o texto contribuiu para sua posição enquanto pertencente a uma sociedade permeada de contradições.','X-5','2023-02-20 18:42:22','2023-02-20 18:42:22',NULL),(217,2061,3,'14-A','“O papel do Nutricionista na sociedade: uma divulgação para os jovens”','PROEC Fluxo Contínuo - 02/2022',1,1,'O nutricionista é um profissional indispensável para a população, atuando na saúde pública na prevenção de doenças, na clínica principalmente em tratamento de patologias, na alimentação coletiva para fornecimento de um alimento seguro, agradável e adequado nutricionalmente às necessidades dos comensais. Assim, o projeto tem o objetivo de divulgar informações o papel do nutricionista nas diversas áreas de atuação para jovens concluintes do ensino médio, de forma a esclarecer e divulgar a profissão e mostrar a importância da alimentação adequada e o papel do nutricionista nesse contexto. Os estudantes de nutrição deverão elaborar materiais de forma criativa que possibilite a transmissão das informações para a comunidade, o qual será apresentado para alunos do 3º ano do ensino médio; cada grupo ficará responsável por uma área de atuação do nutricionista, abordando locais de trabalho, atribuições, conceito e assuntos necessários e importância do profissional na área.','X-5','2023-02-20 19:08:30','2023-02-20 19:08:30',NULL),(218,2061,3,'14-B','Alimentação saudável durante a gestação e lactação e práticas do aleitamento materno nos primeiros meses de vida','PROEC Fluxo Contínuo - 02/2022',1,1,'Na gestação é essencial que haja cuidado com relação ao ganho de peso da mãe, ingestão adequada de nutrientes e estilo de vida saudável, para o crescimento e desenvolvimento normal do bebê, além de evitar complicações à saúde materna. É necessário, assim, que ações práticas de extensão sejam realizadas na área de Nutrição Materno-Infantil para levar conhecimento para a população de forma a promover saúde na gravidez e na primeira infância, etapas tão importantes para a prevenção de saúde ao longo da vida. O objetivo do projeto é conscientizar gestantes sobre a importância da alimentação saudável durante a gestação e lactação e da prática do aleitamento materno nos primeiros meses de vida. Serão realizadas ações de saúde para gestantes e puérperas, sobre Nutrição na gestação e lactação, com palestras e oficinas dinâmicas de forma presencial, em UBS de Petrolina-PE.','X-7','2023-02-20 19:10:21','2023-02-20 19:10:21',NULL),(219,2061,3,'14-C','Ambulatório em Nutrição: a saúde da mulher portadora de SOP','PROEC Fluxo Contínuo - 02/2022',1,6,'A Síndrome dos Ovários Policísticos (SOP) é uma doença promotora de disfunções no sistema endócrino-metabólico que acomete mulheres em idade fértil e se manifesta, principalmente pela resistência à insulina, elevação dos sinais de hiperandrogenismo, dislipidemias e obesidade. Sendo assim, o estilo de vida com consumo elevado de alimentos açucarados, ricos em sódio e gordura, com alta densidade calórica e baixa qualidade nutricional, atrelado ao sedentarismo, pode potencializar as principais complicações. Diante disso, propõe-se a criação de um Ambulatório de Nutrição focado no atendimento a mulheres com diagnóstico de SOP, objetivando avaliação e acompanhamento nutricional individualizados, para contribuir na melhora da sintomatologia e promover qualidade de vida. Pretende, ainda, oportunizar aos estudantes extensionistas o contato com a comunidade no âmbito do atendimento nutricional; desenvolver ações de promoção, proteção e reabilitação da saúde, em nível individual, além de desenvolver competências e habilidades para avaliar, sistematizar e decidir as condutas mais adequadas.','X-5','2023-02-20 19:14:19','2023-02-20 19:14:19',NULL),(220,2061,3,'14-D','Popularização da Nutrição, enquanto ciência e princípio básico para qualidade de vida','PROEC Fluxo Contínuo - 02/2022',1,6,'O curso de Nutrição da Universidade de Pernambuco – Campus Petrolina, iniciou suas aulas no dia 02 de agosto de 2010; a maioria das disciplinas possuem aulas teóricas e práticas, e o PPC vigente preconiza 10% do currículo como atividades de extensão, sendo valorizado a atuação dos discentes e docentes na comunidade (UPE, 2019). Os estágios e aulas práticas são realizados em Hospitais, Clínicas, Restaurantes, UBS, e outros locais como o Parque Municipal Josefa coelho. o presente projeto visa promover o curso de nutrição da Universidade de Pernambuco – Campus Petrolina e sua atuação na região, de forma a divulgar as ações realizadas pelo corpo docente e discente para que possamos ter uma ligação constante com comunidade que nos abriga e popularizar a Nutrição como ciência importante para a saúde populacional.','X-5','2023-02-20 19:15:37','2023-02-20 19:15:37',NULL),(221,1883,3,'14-A','Língua Africana na Língua Portuguesa: construção de podcast\'s educativos sobre a Lei n.º 10.639 na Formação Docente','Fluxo continuo',2,2,'colaboração nas atividades do projeto','X-5','2023-02-20 19:35:10','2023-02-20 19:41:06',NULL),(222,1883,3,'14-B','Contribuições da História da Educação para pensar o bicentenário da independência','Fluxo Contínuo, Pró-Retioria de Extensão e Cultura (PROEC) da Universidade de Pernambuco',2,2,'Colaboração junto a UFPB nas ações do projeto','X-5','2023-02-20 19:37:21','2023-02-20 19:40:49',NULL),(223,1883,3,'14-C','Editorial da Revista Formação','Fluxo continuo',2,2,'Colaboração para a editoração da Revista Formação','X-5','2023-02-20 19:38:58','2023-02-20 19:41:18',NULL),(224,1883,3,'14-D','Diálogos sobre História da Educação','Fluxo continuo',2,2,NULL,'X-5','2023-02-20 19:42:03','2023-02-20 19:42:03',NULL),(225,1883,3,'14-E','Curso Pesquisa e Elaboração de Projetos Científicos em Educação','Fluxo continuo',1,3,'Coordenação curso','X-6','2023-02-20 19:43:41','2023-02-20 19:43:41',NULL),(226,2052,3,'14-A','REUPE CONECTA: VEICULAÇÃO DAS MÍDIAS DIGITAIS E FUNCIONALIDADES DO SISTEMA COMO INTEGRAÇÃO TECNOLÓGICA DA REVISTA DE EXTENSÃO DA UNIVERSIDADE DE PERNAMBUCO','PROJETO DE EXTENSÃO',2,2,'Colabora no projeto contribuindo com a divulgação da extensão por meio das mídias digitais através da REUPE e redes sociais.','X-5','2023-02-21 23:27:0