cias - PROPEAV',2,2,NULL,'X-4','2023-02-22 18:57:51','2023-02-25 03:37:47',NULL),(233,1990,3,'14-A','DISSEMINANDO CONHECIMENTO SOBRE RESSUSCITAÇÃO CARDIOPULMONAR: COMO EVITAR MORTES PREMATURAS','Programa de Promoção a Saúde e Prevenção das Emergências, Acidentes e Violências no Vale do São Francisco - PROPEAV',1,4,'A parada cardiorrespiratória (PCR) define-se pela cessação súbita e inesperada dos batimentos cardíacos e  movimentos respiratórios. A reanimação cardiopulmonar (RCP) é o conjunto de ações prestadas à vítima de PCR a fim de manter artificialmente o fluxo sanguíneo aos órgãos vitais até o retorno da circulação espontânea. Considerando a gravidade e imprevisibilidade desse evento e seguindo diretrizes da American Heart Association (AHA)/2015, objetiva-se capacitar a população em geral e moradores do bairro Idalino Bezerra do município de Petrolina/PE com relação a RCP e o uso do desfibrilador externo automático. Utilizando a metodologia participativa envolvendo palestras educativas e treinamento prático sobre RCP utilizando o manequim simulador. Espera-se promover a disseminação do conhecimento sobre RCP, a fim de evitar mortes prematuras e sem sequelas à população em geral. Além disso, permitir aos discentes a ampliação do conhecimento sobre a temática e o desenvolvimento de habilidade para exposição de ideias em público. Estima-se beneficiar em média 300 pessoas.','X-5','2023-02-22 19:11:49','2023-02-23 20:31:22',NULL),(234,2034,3,'14-A','Aprendizagem de conteúdos matemáticos da Educação Básica: possibilidades de intervenção para promover o sucesso escolar de cidadãos (Aprovado no edital EDITAL PROEC PFA - 01/2022)','Projeto não é vinculado a programa.',1,6,'Desenvolvimento de atividades/tarefas com jogos matemáticos e vídeos educativos para alunos dos ensinos fundamental e médio numa tentativa de amenizar as dificuldades apresentadas na disciplina de matemática','X-5','2023-02-22 20:12:39','2023-02-22 20:12:39',NULL),(235,2034,3,'14-B','A UTILIZAÇÃO DE PLATAFORMAS DE COMPUTAÇÃO EM NUVEM PARA O DESENVOLVIMENTO DE VÍDEO MARKETING EM EMPRESAS DE ENERGIAS RENOVÁVEIS','Projeto não é vinculado a programa.',1,3,'Esse projeto de extensão faz parte do projeto de extensão tecnológica da Fundação de Amparo à Ciência e Tecnologia do Estado de Pernambuco (Facepe) que buscar efetuar ações relevantes para o ambiente empresarial e está alinhado com a Estratégia de Ciência, Tecnologia e Inovação de Pernambuco. Nesse sentido, o projeto tem como objetivo desenvolver conteúdos audiovisuais educativos, informativos relativos à temática de energias renováveis para implementar sites, redes sociais e apresentações das empresas, facilitando sua comunicação com o cliente e aumentando o alcance da marca. Bem como, desenvolver ações de conscientização para utilização de fontes de energias renováveis para estudantes da educação básica.','X-5','2023-02-22 20:14:56','2023-02-22 20:14:56',NULL),(236,2001,3,'14-A','Fisiologia na Veia','Fisiologia na Veia',1,6,'Produção de conteúdo para mídias sociais.\r\nhttps://www.instagram.com/fisiologianaveia/','X-4','2023-02-22 21:59:15','2023-02-22 22:01:41',NULL),(240,2071,3,'14-A','Programa de Reabilitação Funcional na Síndrome Pós COVID-19: Atuação Interprofissional (REABGRUPE)','Programa de Reabilitação Funcional na Síndrome Pós COVID-19: Atuação Interprofissional (REABGRUPE)',2,3,NULL,'X-4','2023-02-23 05:38:38','2023-02-23 05:38:38',NULL),(241,1172,3,'14-A','FCAP FINANCE','FCAP FINANCE',2,6,'Orientação e acompanhamento de estudantes na Liga Financeira da FCAP.','X-4','2023-02-23 05:59:20','2023-02-23 05:59:20',NULL),(243,1153,3,'14-A','BALCÃO DE ORIENTAÇÃO E SERVIÇOS JURÍDICOS','Programa de Extensão EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,2,'Objetivo Geral\r\nViabilizar orientações e serviços jurídicos para a população menos favorecida.\r\n\r\nObjetivos Específicos\r\n* Aliar aos componentes teóricos propostos na malha curricular do curso de Direito a materialização da prática, pela via da observação, aos discentes;\r\n* Proporcionar a população menos favorecida de Recife e cidades adjacentes a conscientização de seus direitos e garantias fundamentais previstos da Carta da República;\r\n* Estabelecer os caminhos que a parte interessada deverá efetuar em caso de lesão a direito;\r\n* Apontar o órgão do Judiciário competente para processar e julgar a demanda, a ação adequada e documentos necessários;\r\n* Encaminhar para a Câmara de Conciliação da FCAP os casos passíveis de serem resolvidos pela via da conciliação ou mediação;','X-5','2023-02-23 06:19:10','2023-02-24 04:50:30',NULL),(244,1153,3,'14-B','Observatório do Direito Médico e da Saúde da FCAP/UPE','Edital PROEC Fluxo Contínuo 02-2022',1,2,'OBJETIVO GERAL – Debater temáticas atuais e relevantes sobre o Direito Médico e da Saúde.\r\nOBJETIVOS ESPECÍFICOS\r\n- Promover eventos com experts na área do Direito Médico e da Saúde a fim de discutir sobre temas específicos; \r\n- Analisar a jurisprudência dos tribunais brasileiros em matéria de Direito Médico e da Saúde','X-5','2023-02-23 06:23:05','2023-02-24 04:50:42',NULL),(245,1155,3,'14-B','Observatório do Direito Médico e da Saúde da FCAP/UPE','EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,2,'OBJETIVO GERAL – Debater temáticas atuais e relevantes sobre o Direito Médico e da Saúde.\r\nOBJETIVOS ESPECÍFICOS\r\n- Promover eventos com experts na área do Direito Médico e da Saúde a fim de discutir sobre temas específicos; \r\n- Analisar a jurisprudência dos tribunais brasileiros em matéria de Direito Médico e da Saúde','X-5','2023-02-23 06:26:15','2023-02-23 06:26:15',NULL),(246,1155,3,'14-A','BALCÃO DE ORIENTAÇÃO E SERVIÇOS JURÍDICOS','EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,2,'Objetivo Geral\r\nViabilizar orientações e serviços jurídicos para a população menos favorecida.\r\n\r\nObjetivos Específicos\r\n* Aliar aos componentes teóricos propostos na malha curricular do curso de Direito a materialização da prática, pela via da observação, aos discentes;\r\n* Proporcionar a população menos favorecida de Recife e cidades adjacentes a conscientização de seus direitos e garantias fundamentais previstos da Carta da República;\r\n* Estabelecer os caminhos que a parte interessada deverá efetuar em caso de lesão a direito;\r\n* Apontar o órgão do Judiciário competente para processar e julgar a demanda, a ação adequada e documentos necessários;\r\n* Encaminhar para a Câmara de Conciliação da FCAP os casos passíveis de serem resolvidos pela via da conciliação ou mediação;','X-5','2023-02-23 06:28:15','2023-02-23 06:28:15',NULL),(247,2022,3,'14-A','Programa de Reabilitação Funcional na Síndrome Pós Covid-19: atuação interprofissional (ReabGRUPE)','Programa de Reabilitação Funcional na Síndrome Pós Covid-19: atuação interprofissional (ReabGRUPE)',1,6,'Coordaeção do programa com ações relacionadas ao programa de fisioterapia a população com COVID-19','X-4','2023-02-23 16:28:20','2023-02-23 16:28:20',NULL),(248,2063,3,'14-A','LUGAR DE CRIAÇÃO','LUGAR DE CRIAÇÃO',1,6,'A finalidade deste Programa é de proporcionar aos sujeitos em diversas interações sociais: autores/leitores/poetas em com construção, uma imersão no processo de criação. A arte impregnada nas práticas sociais de letramentos; uma arte da escrita, uma arte literária, uma arte de compartilhar a leitura declamada, oralizada, cantada, desenhada. Uma arte da literatura do desmonte, considerando questões socioculturais, artísticas e identitárias. Para tanto, este estudo traz uma concepção de letramento como prática social cunhada por Street (2014) e Kleiman (2005) que dialoga com as produções escritas; leituras; oralidade declamada e recitada; a narrativa de si. Os diversos atores têm suas práticas sociais carregadas de marcas identitárias. Um programa que aproxima as distâncias, mesmo com a complexidade do encontro, como Morin (2020), indica que vivendo as incertezas descortinadas pela Pandemia da Covid-19. Incertezas que convidaram a população, de modo geral, a pensar seus valores e de maneira específica, a profissão docente a refletir seu lugar de criação em tempos de atividades remotas. Por esse viés, propõe um  percurso metodológico na perspectiva qualitativa que considera a noção de método da pesquisa-forma-ação-docente presente nas discussões de Mariano e Santos (2018). Com uma tripla relevância dos resultados, pois além de potencializar produções nas marcas identitárias presentes na arte pela palavra, é, acima de tudo, um método que considera o lugar de criação, o lugar de criação-formação. Contribuirá para o desenvolvimento dos estudantes de Letras na garantia de um lugar de criação docente. Por fim, um horizonte de possíveis publicações e divulgação, escrita e oral, e, possíveis produções científicas tão exigidas no processo de construção do conhecimento acadêmico.\r\n\r\nPalavras-chave:  Extensão e ensino; Pesquisa; Traços autobiográficos;  Arte literária; Ambientes síncronos assíncronos.','X-4','2023-02-23 16:49:31','2023-02-23 16:49:31',NULL),(249,2063,3,'14-B','LUGAR DE ESCREVINHAR','LUGAR DE CRIAÇÃO',1,2,'A finalidade deste trabalho é de proporcionar aos estudantes e àqueles que saíram a pouco da Educação Básica que possuem uma aflição pela escrita uma imersão no processo de criação literária, considerando questões socioculturais, artísticas, subjetivas e identitárias. Para tanto, este estudo traz uma concepção de letramento como prática social cunhada por Street (2014) e por Kleiman (2005), uma vez que tais acepções dialogam com as produções carregadas de marcas identitárias e subjetivas pretendidas na execução deste projeto. Além disso, ancora-se nas reflexões de Morin (2020) sobre as incertezas descortinadas pela pandemia da Covid-19, que convidou a população, de modo geral, a pensar seus valores e, de maneira específica, a profissão docente a refletir seu lugar de criação em tempos de atividades remotas e híbridas. Por esse viés, propõe um  percurso metodológico na perspectiva qualitativa que considera a noção de método da pesquisa-formação-docente presente nas discussões de Mariano e Santos (2018) a fim de se alcançar uma tripla relevância dos resultados. Isso porque, além de potencializar a escrita estudantil e juvenil no âmbito literário, também contribuirá para o desenvolvimento dos estudantes de Letras na garantia de um lugar de criação docente. Por fim, manter-se-á um horizonte de possíveis publicações e produções técnico científicas tão exigida na construção do conhecimento acadêmico.\r\n\r\nPalavras-chave: Extensão. Lugar de Escrevinhar. Escrita literária. Letramento','X-5','2023-02-23 16:50:27','2023-02-23 16:52:14',NULL),(250,2063,3,'14-C','TÁTICAS DIDÁTICAS DE CRIAÇÃO DOCENTE - TDCD','LUGAR DE CRIAÇÃO',1,2,'O atual cenário da Educação de base brasileira é de mudanças, ainda, não há uma visível projeção desses contextos de mudanças. Inclusive, redes de ensino reestruturando suas propostas e currículos educacionais que trazem um olhar aguçado para as práticas metodológicas e resultados de ensino e aprendizagem. Diante disso, faz-se necessário, nós que estamos envolvidos na formação, especialmente, a inicial, pensar em proposta de projeto de extensão voltada aos professores e professoras de Língua Portuguesa que têm interesses em participar de propostas de extensão, especialmente, de projetos que fazem parte do Programa Lugar de Criação. Nessa proposta os participantes que são docentes da Educação Básica Pública estarão envolvidos em reflexões, mas também, no próprio ato de produção de atividades sequenciadas chamadas de Táticas Didáticas: metodologias referenciais para o ensino e a aprendizagem. O referido projeto faz parte de ações ligadas ao Programa Lugar de Criação. \r\n\r\nPalavras-chave: Extensão e ensino. Táticas Didáticas. Docentes. Educação Básica. Híbrido.','X-5','2023-02-23 16:51:30','2023-02-23 16:51:30',NULL),(251,2078,3,'14-A','Diabetes – educação, prevenção e cuidado','Diabetes – educação, prevenção e cuidado',2,1,NULL,'X-5','2023-02-23 16:51:49','2023-02-23 17:00:52',NULL),(252,2078,3,'14-B','O INSTAGRAM COMO FERRAMENTA DE DIVULGAÇÃO CIENTÍFICA: O QUE É FATO E O QUE FAKE SOBRE OS PROCESSOS SAÚDE-DOENÇA? (relacionado a disciplina Fundamentos Morfofuncional do Ser Humano)','O INSTAGRAM COMO FERRAMENTA DE DIVULGAÇÃO CIENTÍFICA: O QUE É FATO E O QUE FAKE SOBRE OS PROCESSOS SAÚDE-DOENÇA? (relacionado a disciplina Fundamentos Morfofuncional do Ser Humano)',2,1,NULL,'X-5','2023-02-23 16:52:26','2023-02-23 17:01:02',NULL),(253,2063,3,'14-D','Lugar de Fruição','LUGAR DE CRIAÇÃO',1,2,'Buscando elementos para criar a iniciativa de divulgação, debate e socialização da arte literária e os debates que giram em torno da mesma, o projeto Lugar de Fruição nasce, de maneira a catalisar essas produções artístico-literárias por meio de saraus, rodas de conversas e de leituras. Este projeto intensifica a apropriação de espaços virtuais, presenciais ou híbridos com a arte do recitar, propondo, ademais, discussões de cunho artístico por meio de bate-papos literários e rodas de leituras. Proporcionando a divulgação e socialização de textos literários de terceiros e/ou dos integrantes do projeto. Por fim, possibilitando, assim, o projeto Lugar de Criação.\r\n\r\nPalavras-chave: Escritores. Bate-papos. Sarau. Literatura. Remoto.','X-5','2023-02-23 16:53:42','2023-02-23 16:53:42',NULL),(254,1160,3,'14-A','Construindo o caminho da empregabilidade','Edital de fluxo contínuo',1,4,'Produzir cursos online de curta duração que venham a contribuir com a questão da empregabilidade entre os jovens; \r\nDisponibilizar formação complementar para estudantes e sociedade em geral interessada em empregabilidade, para que entendam sobre gestão de carreira; \r\nPreparar os estudantes e sociedade em geral interessada em empregabilidade para desenvolverem instrumentos utilizados para a participação em processos seletivos;\r\nSupervisionar alunos extensionistas na realização do projeto.','X-5','2023-02-23 17:56:44','2023-02-23 17:56:44',NULL),(256,2077,3,'14-A','Ciência e Inovação no Sertão','Edital PFA de Extensão 01/2021',1,2,'Planejamento/acompanhamento das atividades de extensão que serão realizadas em 2023\r\nResultado final do Edital PFA de Extensão 01/2021: http://upe.br/anexos/extensao/editais/2021/PFA/RESULTADO_final_22_julho.pdf)','X-5','2023-02-23 18:50:13','2023-02-23 18:56:08',NULL),(257,2077,3,'14-B','Biotecnologia micorrízica: biofertilizantes em pomares de videiras na agroindústria do semiárido pernambucano','Projeto aprovado no Edital FACEPE 22/2022 - Programa de Extensão Tecnológica',1,10,'Avaliação da condição micorrízica em pomares de videira da agroindústria, durante as fases fenológicas, nos sistemas de manejo convencional e sustentável (manejo biológico), buscando avaliar a participação que os FMA possam estar realizando efetivamente como biofertilizantes e contribuindo assim para conhecer a base sustentável da atividade agrodustrial no semiárido pernambucano.\r\nPrograma de Extensão Tecnológica – PET (ARC-0538-5.01/22)','X-4','2023-02-23 18:55:26','2023-02-23 19:05:23',NULL),(258,1927,3,'14-A','Reforço escolar nas escolas públicas do município de  Nazaré da Mata','PROEC',2,2,NULL,'X-4','2023-02-23 19:20:24','2023-02-23 19:20:24',NULL),(259,2058,3,'14-A','Ciência no Prato: Traduzindo a Ciência na Área de Nutrição e Ciência de Alimentos','Ciência no Prato: Traduzindo a Ciência na Área de Nutrição e Ciência de Alimentos',1,6,NULL,'X-5','2023-02-23 19:33:12','2023-02-23 19:33:12',NULL),(260,2113,3,'14-A','BALCÃO DE ORIENTAÇÃO E SERVIÇOS JURÍDICOS','EDITAL PROEC FLUXO CONTÍNUO - 02/2022',2,8,'Objetivos Específicos\r\n* Aliar aos componentes teóricos propostos na malha curricular do curso de Direito a materialização da prática, pela via da observação, aos discentes;\r\n* Proporcionar a população menos favorecida de Recife e cidades adjacentes a conscientização de seus direitos e garantias fundamentais previstos da Carta da República;\r\n* Estabelecer os caminhos que a parte interessada deverá efetuar em caso de lesão a direito;\r\n* Apontar o órgão do Judiciário competente para processar e julgar a demanda, a ação adequada e documentos necessários;\r\n* Encaminhar para a Câmara de Conciliação da FCAP os casos passíveis de serem resolvidos pela via da conciliação ou mediação;','X-4','2023-02-23 19:41:07','2023-02-24 03:19:05',NULL),(261,2058,3,'14-B','Ambulatório em Nutrição: a saúde da mulher portadora de SOP','Ambulatório em Nutrição: a saúde da mulher portadora de SOP',1,4,NULL,'X-5','2023-02-23 19:42:17','2023-02-23 19:42:59',NULL),(262,2118,3,'14-A','6º Luau Poético','Lugar de Criação',1,3,'O 6º luau poético consiste em evento vinculado ao programa Lugar de Criação, cadastrado na Pró-reitoria de Extensão e Cultura da Universidade de Pernambuco (UPE).  A licenciatura em Letras abrange disciplinas de diferentes áreas, como Língua Portuguesa, Línguas Estrangeiras e Literatura. Essa formação interdisciplinar possibilita constantes reflexões a respeito da complexidade do processo de construção de sentido, imerso em contexto social e histórico que envolve sujeitos ativos e em construção. Além da complexidade teórica prevista na grade curricular, o processo de formação também implica em práticas acerca de inovações multiculturais, éticas e estéticas em uma sociedade cada vez mais plural e tecnológica.A proposta de realização de um evento cultural e artístico no contexto acadêmico atendeu às demandas previstas para a formação do profissional de Letras (relacionadas aos usos linguísticos, capacidade crítica e senso estético) em contexto sócio-histórico marcado por aceleradas e múltiplas linguagens, características da cibercultura. Pois se, por um lado, as práticas e processos de multiletramentos envolvem multiplicidade de linguagens, semioses e mídias na criação de significação, por outro, promove a pluralidade e diversidade cultural trazida pelos autores/leitores contemporâneos. Além de favorecer a apreensão e respeito à pluralidade cultural, o desenvolvimento da sensibilidade artística pode promover humanização, tendo em vista a melhoria da qualidade das relações, pois auxilia na melhoria das relações interpessoais importantes para todos os integrantes do contexto acadêmico. Essas vivências podem ser devidamente proporcionadas por meio da realização do “6º Luau Poético”, evento que pretende valorizar a elaboração e recepção da arte em geral.','X-8','2023-02-23 20:00:30','2023-02-23 20:00:30',NULL),(263,2118,3,'14-B','Alfabetização e Letramento de Pessoas da Terceira Idade','FATI -Faculdade Aberta da Terceira Idade',1,3,'Historicamente os brasileiros que fazem parte do grupo da terceira idade (a partir de 6anos em países em desenvolvimento) têm apresentado taxa de superação do analfabetismo muito baixa. Esse é um índice preocupante, pois apesar do gradativo envelhecimento populacional, segundo as novas projeções do IBGE, não há um direcionamento específico e efetivo a essa parcela da população que requer um atendimento diferenciado, inclusive no processo educacional. De acordo com a Organização Mundial de Saúde (OMS), o número de pessoas da terceira idade (acima de 60 anos) tem crescido em sociedades economicamente desenvolvidas ou em desenvolvimento. Essa também é a realidade do Brasil, país em que até o ano de 2050 terá sua quantidade de idosos triplicada. Esse cenário apresenta desafios em uma sociedade contemporânea já repleta de profundas transformações sociais, urbanas e familiares (PEREIRA et al., 2005). Apesar desse cenário, segundo as novas projeções do IBGE, não há um direcionamento específico e efetivo a essa parcela da população.\r\n     Além disso, segundo Peres (2009), os idosos brasileiros apresentam taxa de superação do analfabetismo muito baixa. Por esse motivo, decidimos dedicar atenção às pessoas da terceira idade não alfabetizadas, moradoras do município de Petrolina-PE.   O público alvo, participantes do projeto, já demonstra diferentes tipos de letramento e formas de adaptação à sociedade escrita, assim como conhecimento acerca da cultura popular do estado do Pernambuco, transmitida por meio de gêneros orais. Portanto, durante a execução do projeto, os participantes não somente terão acesso a método de alfabetização fundamentado teoricamente, mas também poderão apresentar informações acerca dos diferentes tipos de letramento já utilizados e dos conhecimentos da cultura oral. Essas informações nortearão todo o processo de alfabetização/letramento.','X-5','2023-02-23 20:03:09','2023-02-23 20:03:09',NULL),(264,1918,3,'14-A','Núcleo Extensionista Educação, Trabalho e Movimentos Sociais','Núcleo Extensionista Educação, Trabalho e Movimentos Sociais',2,3,'Seu objetivo é promover a práxis da educação e do trabalho na perspectiva dos sujeitos do campo, considerando avanços, retrocessos e potencialidades (desafios e propostas) face à atual conjuntura política nacional e internacional; estimular a participação do público interno (docentes e discentes da UPE) e do público externo (Movimentos Sociais, ONGs, Secretarias de Educação e instituições populares e comunitárias)','X-5','2023-02-23 20:25:34','2023-02-23 20:26:43',NULL),(265,1990,3,'14-B','Programa de Promoção a Saúde e Prevenção das Emergências, Acidentes e Violências no Vale do São Francisco - PROPEAV','Programa de Promoção a Saúde e Prevenção das Emergências, Acidentes e Violências no Vale do São Francisco - PROPEAV',1,6,'As ações de fortalecimento da promoção da saúde e prevenção de agravos e doenças foram estabelecidas desde a criação do Sistema Único de Saúde (SUS) em 1988. Esse programa tem como objetivo: Promover ações de saúde e ações voltadas para prevenção das emergências, acidentes e violências no Vale do São Francisco. O programa articula desde 2017 projetos voltados para temática da promoção à saúde, das emergências, dos acidentes e das violências. Como forma de adequação didática da proposta, o programa trabalha dois eixos temáticos: “Promoção à Saúde” e “Prevenção das emergências, acidentes e violências”. O programa conta com equipe multidisciplinar do Campus como membros internos incluindo os cursos de enfermagem, fisioterapia e nutrição, na proposição dos diversos projetos de extensão articulados nos dois eixos do programa.','X-4','2023-02-23 20:31:04','2023-02-23 20:31:04',NULL),(266,2040,3,'14-A','PROPICS: Programa de Práticas Integrativas Complementares em Saúde','PROPICS: Programa de Práticas Integrativas Complementares em Saúde',1,6,'O Programa em Práticas Integrativas Complementares em Saúde (PROPICS) visa fornecer o cuidado integral e humanizado com a atuação de profissionais da Enfermagem e da Nutrição à população residente do Município de Petrolina, tendo por objetivo ofertar atendimento nas modalidades das Práticas Integrativas Complementares em Saúde: auriculoterapia, meditação e reiki.\r\nDesta forma, a implantação deste Programa poderá contribuir para o fortalecimento das práticas integrativas e complementares como forma de auxiliar no tratamento e na assistência à saúde do Município.','X-4','2023-02-23 20:50:37','2023-02-23 20:50:37',NULL),(267,2040,3,'14-B','Programa de Reabilitação Funcional na Síndrome Pós Covid- 19: Atuação Interprofissional (ReabGRUPE)','Programa de Reabilitação Funcional na Síndrome Pós Covid- 19: Atuação Interprofissional (ReabGRUPE)',2,6,'O objetivo do Programa é ofertar o cuidado integral e humanizado aos pacientes acometidos pela COVID-19, para rápido retorno às atividades laborais e de vida diária. Entre os atendimentos ofertados contamos com roteiros de exercícios físicos e respiratórios, acompanhamento nutricional e orientações da enfermagem sobre informações e cuidados referentes à doença.','X-4','2023-02-23 20:56:22','2023-02-23 20:56:22',NULL),(268,1088,3,'14-A','Movimento integrado pelo resgate da consciência ambiental e em saúde- MIRCAS','Programa de Fortalecimento Acadêmico - PFA -PROEC',1,2,'Despertar a consciência ambiental e sustentabilidade correlacionando com a educação em saúde para estudantes do Ensino Fundamental 1 da Escola Municipal Cidadão Herbert de Souza.\r\nMinistrar palestras sobre prevenção de doenças, higiene e saúde, coleta seletiva e preservação ambiental;\r\nOferecer gincanas para coleta de materiais recicláveis;\r\nRealizar oficinas de reciclagem e cultivo de hortas;\r\nPromover ação social no Campus Santo Amaro com atividades lúdicas para crianças;','X-5','2023-02-23 21:23:18','2023-02-23 21:23:18',NULL),(269,1991,3,'14-A','Programa de promoção à saúde e prevenção das emergências, acidentes e violências no Vale do São Francisco (PROPEAV)','Participação em atividades de extensão',2,2,NULL,'X-4','2023-02-23 21:43:04','2023-02-23 21:43:04',NULL),(270,1991,3,'14-B','Cuidar-se','Acompanhamento de estudantes em atividades de extensão',2,3,NULL,'X-5','2023-02-23 21:45:48','2023-02-23 21:46:05',NULL),(271,1975,3,'14-A','Programa de educação para a melhor idade no Vale do São Francisco- FATI.','Programa de educação para a melhor idade no Vale do São Francisco- FATI.',1,8,'Coordenar o Programa','X-4','2023-02-23 21:59:17','2023-02-23 21:59:17',NULL),(272,1975,3,'14-B','Promovendo Educação interprofissional em saúde para idosos','Promovendo Educação interprofissional em saúde para idosos',2,2,'Co orientadora do Projeto módulo saude da FATI','X-5','2023-02-23 22:05:53','2023-02-23 22:05:53',NULL),(273,1489,3,'14-A','Semana do Meio Ambiente 2022','Evento',1,3,'Coordenador da Semana do Meio Ambiente que foi evento híbrido com sua parte presencial ocorrendo nas dependências do ICB em Junho de 2022. Este evento contou com a participação de palestrantes e alunos externos à UPE com os participantes tendo acesso a mesas redondas, mini-cursos e palestras. Todos os eventos possuíram professores colaboradores e monitores responsáveis na organização das atividades.','X-8','2023-02-23 22:51:38','2023-02-23 22:51:38',NULL),(274,1489,3,'14-B','Semana do Biólogo','Evento',1,3,'Coordenador da Semana Biólogo que foi presencial ocorrendo nas dependências do ICB em setembro de 2022. Foi um evento voltado ao aluno do Curso de Bacharelado em Ciências Biológicas e contou com a participação de convidados externos à UPE tendo ofertado mesas redondas, mini-cursos e palestras. Todas as atividades tiveram professores colaboradores e monitores responsáveis na organização das mesmas.','X-8','2023-02-23 22:56:02','2023-02-23 22:56:02',NULL),(275,1910,3,'14-A','Núcleo de Estudos do Cinema Negro e Práticas Antirracistas.','PROEC-  Edital Fluxo Continuo',2,1,'Este projeto de extensão realizado no âmbito do Programa de Pós-Graduação stricto sensu em Educação da Universidade de Pernambuco, na linha de pesquisa Políticas e Gestão Educacional, tem como objetivo a criação de um núcleo de estudos do cinema negro e de práticas antirracistas com e dos estudantes, para proporcionar a democracia e protagonismo estudantil na gestão escolar, sob coordenação de José Correia de Amorim Junior.','X-5','2023-02-23 23:02:52','2023-02-23 23:02:52',NULL),(276,1910,3,'14-B','FCT 2022- Feira de Ciências e Tecnologia da UPE- Campus Mata Norte','Edital PROEC PFA 01/2022',1,4,NULL,'X-5','2023-02-23 23:07:11','2023-02-23 23:07:11',NULL),(277,2004,3,'14-A','Programa de Promoção à Saúde e Prevenção das Emergências, Acidentes e Violências do Vale do São Francisco - PROPEAV','Programa de Promoção à Saúde e Prevenção das Emergências, Acidentes e Violências do Vale do São Francisco - PROPEAV',1,2,'Coordenadora do Programa de Extensão - PROPEAV.','X-4','2023-02-23 23:16:53','2023-02-23 23:16:53',NULL),(278,1923,3,'14-A','Educação Emocional: Preparando professores da rede básica para o ensino de habilidades socioemocionais','Edital PFA 2021',1,2,'Reuniões de formação/orientação com os discentes;\r\nReunião com os responsáveis pela rede de ensino municipal;\r\nEncontro de formação com os docentes.','X-5','2023-02-23 23:18:48','2023-02-23 23:18:48',NULL),(279,2067,3,'14-A','O XADREZ COMO FERRAMENTA PEDAGÓGICA PARA A RESOLUÇÃO DE PROBLEMAS EM MATEMÁTICA','Curso de Extensão',2,3,'Promover a prática do xadrez na Universidade de Pernambuco - Campus Petrolina - como forma de incentivar e exercitar o hábito de pensar, refletir, criar, imaginar, criar, raciocinar de forma lógica, calcular e simular situações\r\n\r\n● Promover a prática do xadrez como recurso pedagógico, educativo, esportivo e recreativo;\r\n● Ofertar um curso introdutório de xadrez na Universidade de Pernambuco -campus Petrolina- como forma de promover uma maior integração entre docentes, discentes da graduação e da educação básica, comunidade em torno do campus que tenham interesse em desenvolver técnicas de cálculo, contagem e gestão de riscos por meio do jogo de xadrez;\r\n● Promover encontros semanais dedicados ao treino da prática de xadrez buscando principalmente melhorar as habilidades de concentração, paciência, memória, intuição, cálculo, análise dedutiva;\r\nCompreender o seu papel social de educador e incentivador e a capacidade de se inserir em diversas realidades com sensibilidade para interpretar as ações dos educandos;\r\n● Contribuir para que a aprendizagem da Matemática possa oferecer à formação dos indivíduos para o exercício de sua cidadania; ● Enxergar que o conhecimento matemático pode ser desenvolvido a partir do xadrez e deve ser acessível a todos, e consciência de seu papel na superação dos preconceitos, traduzidos pela angústia, inércia ou rejeição; ● No que se refere às competências e habilidades próprias do professor de matemática ou de outra licenciatura ou bacharelado, mediante a participação no curso de extensão, os cursistas desenvolveram as capacidades de: ● Elaborar propostas de ensino-aprendizagem em Matemática e em outras áreas do saber para a educação básica; ● Identificar e Analisar criticamente propostas curriculares de Matemática/outras áreas de atuação para a educação básica; ● Desenvolver estratégias de ensino que favoreçam a criatividade, a autonomia e a flexibilidade do pensamento matemático dos educandos, buscando trabalhar com mais ênfase nos conceitos do que nas técnicas, fórmulas e algoritmos;','X-6','2023-02-23 23:22:29','2023-02-23 23:22:29',NULL),(280,2004,3,'14-B','Regulação no Sistema Único de Saúde: acesso ou barreira?','Não vinculado',1,2,'Trata-se um Seminário com formação de uma mesa redonda para discutir a regulação integrada no Vale do Médio São Francisco, os avanços e desafios a partir da experiência pioneira na regulação interestadual no país. A atividade busca suscitar a discussão dos processos regulatórios em nível ambulatorial e hospitalar com a participação de profissionais que atuam na regulação do estado de Pernambuco e na Regulação Interestadual da Rede Pernambuco/Bahia. Serão discutidas as questões atuais relacionadas à regulação como: a real atuação como barreira ou melhoria do acesso aos serviços de saúde com a implementação da regulação.','X-8','2023-02-23 23:26:55','2023-02-23 23:26:55',NULL),(281,2009,3,'14-A','Consultoria gratuita em controle de qualidade de alimentos para serviços de alimentação: uma devolutiva social, profissional, acadêmica, econômica e científica','Projeto',1,6,'Projeto de extensão desenvolvido na disciplina de higiene e microbiologia dos alimentos.','X-5','2023-02-23 23:45:16','2023-02-23 23:45:16',NULL),(282,2009,3,'14-B','QUALIUPE: MAIS QUALIDADE E SEGURANÇA NOS SERVIÇOS DE ALIMENTAÇÃO','Projeto',1,6,'Projeto desenvolvido nas disciplinas de ASA 1 e 2, e HMA.','X-5','2023-02-23 23:49:15','2023-02-23 23:49:15',NULL),(283,2009,3,'14-C','NUTRINDO ALÉM: MODIFICANDO REALIDADES ECONÔMICAS E DE SAÚDE DURANTE E APÓS A PANDEMIA','Projeto',1,6,NULL,'X-5','2023-02-23 23:50:13','2023-02-23 23:50:13',NULL),(284,2043,3,'14-A','FILMCLUB: IMAGENS EM PAUTA','PROJETO DE EXTENSÃO',1,4,'Uso de filmes em Lingua Inglesa para aprimoramento da língua e da leitura de imagens','X-5','2023-02-24 00:37:05','2023-02-24 00:40:24',NULL),(285,2014,3,'14-A','III CICLO DE CINEMA ESPANHOL','III CICLO DE CINEMA ESPANHOL',2,2,'Este projeto nasce a partir das solicitações de alunos no tocante a prática da conversação de língua espanhola, é pensando no aperfeiçoamento da oralidade dos estudantes de Letras em língua espanhola que se sugere a partir da produção fílmica, um debate, uma reflexão e uma troca intercultural dos envolvidos a partir de diálogos em língua espanhola. Dessa forma, além de estarmos praticando as destrezas de escucha y oralidad, também estaremos contribuindo para uma formação crítica e linguística dos estudantes de Letras de Língua Espanhola.','X-4','2023-02-24 00:44:06','2023-02-24 00:44:06',NULL),(286,1973,3,'14-A','Aprendizagem de conteúdos matemáticos da Educação Básica: possibilidades de intervenção para promover o sucesso escolar de cidadãos,','Programa de extensão em ensino e aprendizagem da matemática na educação básica numa perspectiva lúdica',1,6,NULL,'X-5','2023-02-24 04:31:35','2023-02-24 04:31:35',NULL),(287,1153,3,'14-C','TÉCNICAS PARA CONSTRUÇÃO DE PROJETOS PARA SELEÇÃO DE MESTRADO/DOUTORADO ORIUNDO DE EDITAIS DE IES DA REDE PÚBLICA, PRIVADA E CONFESSA','Programa de Extensão EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,2,'A elaboração de projetos de pesquisa para concorrer a uma das vagas em editais de\r\nmestrado/doutorado constitui um desafio para os seus proponentes. Técnicas de redação, assim como\r\no domínio metodológico necessário para construção dos projetos são fundamentais para o êxito\r\nnesses concursos. O PROJETO se propõe a fornecer os subsídios necessários para elaboração de\r\nprojetos através de minicursos. Ainda se presta a estabelecer uma conexão com as disciplinas\r\nexistentes nas matrizes do PPGGDLS/UPE e dos cursos de graduação em Direito e Administração da\r\nFCAP/UPE.  O público-alvo são os profissionais que desejam\r\ningressar em programas de mestrado/doutorado, sejam eles ou não da UPE, e mestrandos do\r\nPPGGDLS/UPE, além do público externo interessado.','X-5','2023-02-24 04:43:47','2023-02-24 04:50:53',NULL),(288,2060,3,'14-A','Fisioterapia na Reabilitação Funcional na Síndrome Pós COVID-19','PROGRAMA DE EXTENSÃO EM REABILITAÇÃO FUNCIONAL NA SÍNDROME PÓS COVID-19: ATUAÇÃO INTERPROFISSIONAL - REABGRUPE',1,6,'O Programa de Reabilitação Funcional na Síndrome Pós COVID-19 visa fornecer o cuidado integral e humanizado com a atuação de profissionais da Enfermagem, Fisioterapia e Nutrição aos pacientes acometidos pela COVID-19, curados clinicamente e em fase de recuperação, para rápido retorno às atividades laborais e de vida diária. Neste contexto, o programa de reabilitação funcional tem por objetivo ofertar atendimento com roteiros de exercícios físicos e respiratórios, acompanhamento nutricional e orientações da enfermagem sobre informações e cuidados referentes à doença. A implantação desse programa visa atender as demandas desses pacientes do Serviço Único de Saúde (SUS), da região do Vale do São Francisco, que, atualmente, não possui um serviço público de reabilitação.','X-5','2023-02-24 04:50:47','2023-02-24 04:50:47',NULL),(289,1155,3,'14-C','TÉCNICAS PARA CONSTRUÇÃO DE PROJETOS PARA SELEÇÃO DE MESTRADO/DOUTORADO ORIUNDO DE EDITAIS DE IES DA REDE PÚBLICA, PRIVADA E CONFESSA','EDITAL PROEC FLUXO CONTÍNUO - 02/2022',1,2,'A elaboração de projetos de pesquisa para concorrer a uma das vagas em editais de mestrado/doutorado constitui um desafio para os seus proponentes. Técnicas de redação, assim como o domínio metodológico necessário para construção dos projetos são fundamentais para o êxito nesses concursos. \r\nO PROJETO se propõe a fornecer os subsídios necessários para elaboração de projetos através de minicursos. Ainda se presta a estabelecer uma conexão com as disciplinas existentes nas matrizes do PPGGDLS/UPE e dos cursos de graduação em Direito e Administração da FCAP/UPE.  O público-alvo são os profissionais que desejam\r\ningressar em programas de mestrado/doutorado, sejam eles ou não da UPE, e mestrandos do\r\nPPGGDLS/UPE, além do público externo interessado.','X-5','2023-02-24 04:52:59','2023-02-24 04:52:59',NULL),(290,2060,3,'14-B','EDUCAÇÃO EM SAÚDE MATERNO INFANTIL','Programa de Extensão em Fisioterapia Neonatal e Pediátrica – BABY GRUPE',2,2,NULL,'X-5','2023-02-24 05:01:15','2023-02-24 05:01:15',NULL),(291,1494,3,'14-A','IST: Informando Sem Tabu','IST',1,1,'O projeto promove ações sobre saúde reprodutiva e educação sexual, englobando temáticas vistas pela sociedade como tabus tais como puberdade, infecções sexualmente transmissíveis-IST, gravidez precoce ou indesejada, aborto, e questões de gênero, à estudantes do ensino fundamental e médio de escolas de rede pública de Recife PE. Para tal, estudantes dos cursos de ciências biológicas, medicina e enfermagem trabalham de forma integrada, utilizando metodologias ativas no âmbito presencial e virtual para promover maior interação e alcance com o público-alvo. Assim, o presente projeto visa a desconstrução de mitos e tabus para promover a saúde sexual e reprodutiva, prevenindo os agravos relacionados.','X-5','2023-02-24 05:03:49','2023-02-25 17:55:37',NULL),(292,1494,3,'14-B','VacinAÇÃO: desenvolvendo a conscientização','vacinAÇÃO',1,1,'Muitos estudantes universitários da área da saúde estão expostos a diversas patologias e agentes biológicos no campo de prática acadêmica, fazendo-se necessárias medidas de biossegurança, dentre elas a completude do calendário de vacina. Recentemente, com a pandemia da covid19, causada pelo SARS-COV 2, tem sido ressaltada a exigência da vacinação contra o vírus pela universidade para que o estudante possa estudar/atuar nos campos de prática, no entanto, a exigência para outros tipos de vacina não é feita com a mesma ênfase. Além disso, a Universidade de Pernambuco, Campus Santo Amaro, não apresenta setor ou projeto que desenvolva atividades voltadas à instrução e controle do estado vacinal de seus alunos e profissionais, até o momento, tornando esse grupo mais vulnerável e suscetível a infecções e agentes patológicos. Diante disso, o projeto desenvolve ações de conscientização sobre a importância da vacinação, orientação, verificação dos cartões vacinais de estudantes para atualização do esquema de imunização desses discentes vinculados aos cursos de saúde no campo de prática.','X-5','2023-02-24 05:08:00','2023-02-25 17:55:47',NULL),(293,1502,3,'14-A','Observando o Rio Capibaribe','Projeto de Extensão',2,4,'O rio Capibaribe destaca-se pela sua importância histórica e social na formação e desenvolvimento de Pernambuco. Desde sua nascente no agreste, seus usos múltiplos variam de irrigação, uso doméstico, transporte e lazer. No trecho urbano da capital pernambucana recebe uma enorme carga de efluentes domésticos, tornando-se inviável para a maioria dos usos, segundo Resolução CONAMA 357. Para análise utilizar-se-á kit fornecido pela Fundação SOS Mata Atlântica, através do método colorimétrico e observações diretas. De fácil análise, gera dados para cálculo de IQA. O monitoramento é feito por voluntários, que posteriormente alimentam um sistema digital, tornando-o público. Na Região Metropolitana de Recife, o projeto pretende avaliar a água do Capibaribe em dois 3 pontos distintos: Parque da Jaqueira e Marco Zero. As coletas serão mensais, nas marés de sizígia. São 14 parâmetros, entre eles: DBO, fósforo, coliformes fecais, presença/ausência de peixes.','X-5','2023-02-24 06:16:40','2023-02-24 06:16:40',NULL),(294,1977,3,'14-A','Diabetes - educação, prevenção e cuidado','Diabetes – educação, prevenção e cuidado (aprovado com recurso pelo Edital PFA Extensão 01/2022)',2,4,'Realização de atividades de educação abordando a diabetes','X-4','2023-02-24 06:41:55','2023-02-24 06:41:55',NULL),(295,2091,3,'14-A','De olho na diabetes','Diabetes - educação, prevenção e cuidado',1,10,NULL,'X-4','2023-02-24 06:43:22','2023-02-24 06:43:22',NULL),(296,2020,3,'14-A','ATIVIDOSO - Atividades para Pessoas Idosas','ATIVIDOSO - Atividades para Pessoas Idosas',1,6,'O projeto ATIVIDOSO (Atividades para Pessoas Idosas) visa  promover a melhora da condição física, cognitiva e cardiovascular de pessoas idosas de Petrolina e região. Para isso são realizadas, semanalmente (todas as sextas-feiras), com duração de uma hora, atividades presenciais com treinamento de mobilidade ativa, equilíbrio corporal, força muscular, flexibilidade, condicionamento cardiorrespiratório e função cognitiva. Como resultados esperamos: (i) Melhorar a mobilidade ativa, equilíbrio corporal, força muscular, flexibilidade, condicionamento cardiorrespiratório e função cognitiva dos participantes; (ii) contribuir para a melhora da qualidade de vida e interação social entre discentes de graduação e idosos da comunidade de nossa região; (iii) Proporcionar articulação entre ensino, pesquisa e extensão no que tange à realização de atividades voltadas para o público idoso; (iv) Contribuir com a formação de profissionais com um perfil humanista, crítico e reflexivo, capacitados a atuar nos níveis de prevenção de agravos e promoção da saúde de pessoas idosas, com base no rigor científico e intelectual.','X-5','2023-02-24 12:22:18','2023-02-24 12:22:18',NULL),(297,2068,3,'14-A','Programa de Extensão vinculado às Vivências Extensionistas.','UPErto de você – (re)encontros das diferenças culturais pós-isolamento social',2,4,'Programa de Extensão vinculado às Vivências Extensionistas, aprovado em PFA-1 2022','X-4','2023-02-24 14:39:33','2023-02-24 14:39:33',NULL),(298,2068,3,'14-B','1. Cursos de Extensão Cidadania em Tela; 2. Jornada Integrativa Universidade-Comunidade; 3. Oficinas de Extensão Cidadanias em Telas','Cidadania em Telas',1,5,'Programa de Extensão que visa potencializar a cultura democrática e a participação política local por meio de formação integrativa, em vista da consolidação da cidadania ativa.','X-4','2023-02-24 14:42:42','2023-02-24 14:42:42',NULL),(299,1154,3,'14-A','balcão de orientação e serviços jurídicos','edital fluxo contínuo 02/2022',2,8,'Objetivo Geral\r\nViabilizar orientações e serviços jurídicos para a população menos favorecida.\r\n\r\nObjetivos Específicos\r\n* Aliar aos componentes t