 do mesmo visando um aumento da sua autoestima e autossuficiência traduzindo em uma melhor qualidade de vida. Nessa perspectiva, ressalta-se a importância de vivência da atividade coral, por constituir-se como um meio excelente de reinventar novos modos do ser-em-grupo por conta da cumplicidade e colaboração necessária de cada participante em prol de um objetivo único: a música que se canta. Dessa forma, o coral passa a estabelecer um território existencial a partir de sua própria expressividade musical. Objetivo: Promover ação interdisciplinar de forma articulada e educativa voltadas a educação em musicalização para terceira idade no Vale do São Francisco. Metodologia: Serão realizados módulos em formato de oficina para realização de atividades que proporcionem o trabalho com a equipe nas salas de aula utilizando dinâmicas, roda de conversa, exposições dialogadas integrando o grupo e fortalecendo a proposta que envolva a música e o idoso. Resultados esperados: Espera se que o programa permita o aprofundamento das discussões acerca do tema proposto por cada módulo e definição dos papeis e troca de saberes e experiência. Assim como, auxilie na melhora da qualidade de vida dos envolvidos.','X-5','2023-02-24 21:45:00','2023-02-24 21:45:00',NULL),(317,1998,3,'14-B','Anatomia Humana: extramuros da universidade – Ano 2022','Projeto',1,1,'A curricularização da extensão vem inovar o ensino superior, quanto às metodologias de ensino/aprendizagem e aproximar a universidade da sociedade. Em época de isolamento social devido a pandemia, o ensino remoto aproximou os indivíduos de maneira virtual. O objetivo do estudo é integrar os graduandos à sociedade estimulando o ensino aprendizagem interdisciplinar envolvendo a Anatomia Humana, por meio das mídias virtuais. O presente projeto será realizado com os discentes de Anatomia Humana dos cursos de saúde. Durante a atividade “extramuros”, a turma será dividida em grupos e acompanhados por um monitor tutor, que deverá desenvolver uma atividade na comunidade envolvendo o conteúdo da anatomia e sua graduação, contendo, informações simples e relevantes ao grupo social envolvido. Em seguida, os estudantes planejarão a atividade a ser aplicada ao grupo comunitário em 30 – 45 min, utilizando as tecnologias da informações e comunicação. Posteriormente, os estudantes irão socializar sua atuação com a turma.','X-5','2023-02-24 21:46:45','2023-02-24 21:46:45',NULL),(318,1177,3,'14-A','Balcão de Orientacão e serviços jurídicos','Edital Proec Fluxo Continuo 02/22',2,6,'Viabilizar orientações e serviços jurídicos para a população menos favorecida. \r\n* Aliar aos componentes teóricos propostos na malha curricular do curso de Direito a materialização da prática, pela via da observação, aos discentes;\r\n* Proporcionar a população menos favorecida de Recife e cidades adjacentes a conscientização de seus direitos e garantias fundamentais previstos da Carta da República;\r\n* Estabelecer os caminhos que a parte interessada deverá efetuar em caso de lesão a direito;\r\n* Apontar o órgão do Judiciário competente para processar e julgar a demanda, a ação adequada e documentos necessários;\r\n* Encaminhar para a Câmara de Conciliação da FCAP os casos passíveis de serem resolvidos pela via da conciliação ou mediação;','X-5','2023-02-24 22:16:49','2023-02-24 22:16:49',NULL),(319,1999,3,'14-A','Promoção à saúde e qualidade de vida na terceira idade','Programa de Promoção à Saúde e Prevenção das Emergências, Acidentes e Violências- PROPEAV',1,3,'Evento de promoção à saúde no parque municipal Josefa Coelho ainda a ser cadastrado na PROEC no edital de fluxo contínuo, vinculado ao PROPEAV. A ser desenvolvido com e por alunos/as do 5 período do curso de enfermagem (21 alunos) e 02 monitoras.','X-8','2023-02-24 22:22:12','2023-02-24 22:22:12',NULL),(320,1181,3,'14-A','Liga de Finanças','Liga de Finanças',1,2,'Coordenação ações Liga Finanças','X-9','2023-02-24 22:23:40','2023-02-24 22:23:40',NULL),(321,1181,3,'14-B','Modatec