 de fluxo contínuo',2,3,'Ministrei oficinas com foco na discussão sobre língua portuguesa normativa para jornalistas e outros membros da sociedade civil, além de, estudantes de Letras.','X-6','2023-02-27 15:54:01','2023-02-27 15:54:01',NULL),(361,1484,3,'14-A','Programa Ciranda Inclusiva Bilingue','Programa Ciranda Inclusiva Bilingue',1,10,'O Programa Ciranda Inclusiva Bilíngue está ancorado no trinômio do Ensino, Pesquisa e Extensão com vasta experiência extensionista multicampi e em comunidades regionais, nacionais e internacionais, com ações distintas e interligadas de: a) Capacitação em Libras de profissionais de diferentes áreas; b) Metodologias de ensino e educação de surdos; c) Produção de material educativo inclusivo bilíngue; d) Acolhimento, apoio e orientação às famílias com crianças surdas; e) capacitação de agentes multiplicadores inclusivos bilingues. Inicialmente chamado PROGRAMA CIRANDA AUDITIVA (2009 a 2019), ampliaram-se as ações para PROGRAMA CIRANDA INCLUSIVA BILÍNGUE (2020 atual). O Ciranda tem suas raízes no ICB, desde 2004 iniciou-se a oferta de cursos de extensão de Libras para os alunos da saúde. Atualmente são mais de dez mil beneficiados com o Programa que é aberto à comunidade brasileira e lusitana. As demandas do Ciranda embasaram a criação do grupo de pesquisa e de estudos com colaboradores internos e externos da UPE que estão em plena expansão.','X-4','2023-02-27 16:56:21','2023-02-27 16:56:21',NULL),(362,1936,3,'14-A','VIII Encontro Pernambucano de Logística','VIII Encontro Pernambucano de Logística',1,4,'- Planejamento das ações do projeto para 2023','X-5','2023-02-27 16:59:39','2023-02-27 17:01:45',NULL),(363,1940,3,'14-A','Tradução de conteúdos audiovisuais para a TV Pernambuco (Edital Extensão 10/2021).','Pró-reitoria de Extensão e Cultura Edital Extensão 10/2021 – Chamada para Tradutores de Espanhol',1,10,'I. Desenvolvimento de protocolo e delimitação de critérios de tradução (reuniões síncronas e atividades assíncrona):\r\n- Cria