om os principais temas abordados nas palestras;\r\n●	Promover vivências positivas aos discentes, capacitando-os como futuros profissionais para o atendimento de pessoas com necessidades especiais;\r\n●	Permitir aos estudantes envolvidos a articulação ensino, pesquisa e extensão, reunindo os conhecimentos sobre as temáticas abordadas na puericultura.','X-5','2023-03-08 06:21:45','2023-03-08 06:21:45',NULL),(428,1763,3,'14-D','Nutrir com amor: nutrição e avaliação antropométrica em uma necessidade especial no sertão do Pajeú','Dialogar sobre a saúde: uma necessidade especial no sertão do Pajeú',2,1,'Promover ações educativas acerca da boa nutrição, alimentação saudável e saúde metabólica aos usuários da APAE do município de Serra Talhada-PE e seus cuidadores, tendo como Objetivos específicos:\r\n●	Disseminar informações baseadas em evidências científica sobre doenças metabólicas, alimentação saudável e boa nutrição;\r\n●	Realizar palestras, oficinas e rodas de conversa para debater sobre as doenças metabólicas mais frequentes na população em questão;\r\n●	Avaliar o estado nutricional e metabólico bem como a rotina alimentar dos usuários da APAE Serra Talhada;\r\n●	Realizar o acompanhamento das medidas antropométricas dos usuários da APAE Serra Talhada e classificá-los quanto ao seu grau de nutrição;\r\n●	Estreitar os laços entre a comunidade acadêmica da Universidade de Pernambuco campus Serra Talhada, os gestores públicos, a sociedade civil organizada e a população do município;\r\n●	Criar panfletos educativos e cartilha com informações sobre boa alimentação e receitas saudáveis para compartilhar com os cuidadores dos usuários da APAE Serra Talhada.','X-5','2023-03-08 06:23:25','2023-03-08 06:23:25',NULL),(429,1178,3,'14-A','Letramento digital','GUIA DE SALA DE AULA PARA APRENDIZAGEM BASEADA EM DESAFIOS',1,6,'A Aprendizagem Baseada em Desafios é uma abordagem multidisciplinar que incentiva os estudantes a aproveitar a tecnologia que usam em suas vidas diárias para resolver desafios do mundo real. É colaborativa e prática, pedindo aos estudantes que trabalhem com colegas, professores e especialistas em suas comunidades e em todo o mundo para fazer boas perguntas, desenvolver um conhecimento mais profundo da área, resolver desafios, agir e compartilhar suas experiências. Aborda uma combinação de preocupações teóricas e práticas sobre as teorias antropológicas e do Direito no contexto de ensino e aprendizagem de nível universitário. Os participantes primeiro analisam como a literatura e a sociedade constroem significados para os desafios contemporâneos. Em seguida, analisamos o desenvolvimento de habilidades sociais, a promoção da motivação e o aprendizado ativo, nos desafios da implementação das soluções pensadas pelos próprios estudantes.','X-4','2023-03-08 12:55:21','2023-03-08 12:57:24',NULL),(430,1178,3,'14-B','CIBERCULTURA','GUIA DE SALA DE AULA PARA APRENDIZAGEM BASEADA EM DESAFIOS',1,4,'Como projeto de extensão proposto para a cadeira de Antropologia Jurídica, criou-se esse perfil no\r\nInstagram a fim de informar diversos públicos sobre as nuances e curiosidades da cibercultura com relação\r\nao âmbito jurídico e, além disso, criar um espaço interativo com esses públicos. O perfil é completamente\r\ncolaborativo entre os integrantes do grupo, fazendo um trabalho mútuo entre todos eles, com uma divisão\r\nde tarefas bem definida.','X-5','2023-03-08 12:57:07','2023-03-08 12:57:07',NULL),(431,1774,3,'14-A','Cuidar de quem cuida: uma necessidade especial no sertão do Pajeú','Dialogar sobre a saúde: uma necessidade especial no sertão do Pajeú',1,2,'Promover a educação e os cuidados relacionados à saúde das cuidadoras dos usuários da APAE Serra Talhada.','X-5','2023-03-08 21:45:33','2023-03-08 21:46:59',NULL),(432,1774,3,'14-B','Atender com amor uma necessidade especial no sertão do Pajeú','Dialogar sobre a saúde: uma necessidade especial no sertão do Pajeú',2,1,'Desenvolver ações de educação e saúde para o adequado crescimento