INSERT INTO `extensao_outro` VALUES (6,1676,3,'16-A','Grupo de Teatro na UPE - TeatrUPE','Participação ativa em atividades realizadas junto ao Grupo de Teatro da Universidade de Pernambuco - TeatrUPE',3,'2022-12-27 18:31:28','2022-12-27 18:31:28',NULL),(7,1720,3,'16-A','Formação de alunos para atividades de Extensão em Teatro e Produção de Literatura','Observando como a produção do cordel, por exemplo, e uso do Teatro como instrumentos de Ensino, procuramos formar os discentes da UPE nessas categorias. Os nossos discentes oferecerão oficinas na comunidade de Garanhuns (escolas, centro comunitários etc.)',16,'2022-12-29 15:51:45','2022-12-29 15:53:41',NULL),(8,1848,3,'16-A','SUPER 2022: UM EVENTO DE EXTENSÃO UNIVERSITÁRIA PARA O AGRESTE PERNAMBUCANO','Colaborador do Evento',2,'2022-12-29 18:01:41','2022-12-29 18:01:41',NULL),(9,1839,3,'16-A','SUPER 2022 (Mesa-Redonda: 29/11, das 11h às 12h)','Participação na mesa-redonda \"Administração, Cidades e Inovação: Percursos investigativos\".',1,'2022-12-30 04:56:58','2022-12-30 04:56:58',NULL),(10,1839,3,'16-B','SUPER 2022 (Oficina: 29/11, das 17h às 18h)','Participação na Oficina \"Ferramentas para melhoria da performance de código\".',1,'2022-12-30 04:57:40','2022-12-30 04:57:40',NULL),(11,1839,3,'16-C','SUPER 2022 (Palestra: 29/11, das 19h às 20h)','Participação na palestra de Abertura da SUPER 2022: \"Como Reinventar Negócios a partir da Tecnologia\".',1,'2022-12-30 04:58:45','2022-12-30 04:58:45',NULL),(12,1839,3,'16-D','SUPER 2022 (Palestra: 30/11, das 17h às 18h)','Participação na palestra: \"Estrategias de Desarollo para Pequeños Negocios en el Estado del Mexico\".',1,'2022-12-30 04:59:29','2022-12-30 04:59:29',NULL),(13,1839,3,'16-E','SUPER 2022 (Palestra: 30/11, das 19h às 20h)','Participação na palestra: \"Uso de IOT na previsão de fenômenos climáticos\".',1,'2022-12-30 05:00:07','2022-12-30 05:00:07',NULL),(15,1855,3,'16-B','Mediação de Mesa Redonda na Super 2022','Mediação de Mesa Redonda na Super 2022 (29.11.2